            CREATE TABLE IF NOT EXISTS `translations` (
                `translation` VARCHAR(255) PRIMARY KEY,
                `title` VARCHAR(255),
                `license` TEXT
            );
            

            SELECT 'Tyndale', '# Tyndale: William Tyndale Bible (1525/1530)', 'Public Domain'
            WHERE NOT EXISTS (
                SELECT 1 FROM `translations` WHERE `translation` = 'Tyndale'
            );
            

            CREATE TABLE `Tyndale_books` (
                `id` INT AUTO_INCREMENT PRIMARY KEY,
                `name` VARCHAR(255)
            );
            

            CREATE TABLE `Tyndale_verses` (
                `id` INT AUTO_INCREMENT PRIMARY KEY,
                `book_id` INT,
                `chapter` INT,
                `verse` INT,
                `text` TEXT,
                FOREIGN KEY (book_id) REFERENCES `Tyndale_books`(id)
            );
            
