INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 1, 'In the begynnynge God created heaven and erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 2, 'The erth was voyde and emptie ad darcknesse was vpon the depe and the spirite of god moved vpon the water');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 3, 'Than God sayd: let there be lyghte and there was lyghte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 4, 'And God sawe the lyghte that it was good: and devyded the lyghte from the darcknesse');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 5, 'and called the lyghte daye and the darcknesse nyghte: and so of the evenynge and mornynge was made the fyrst daye');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 6, 'And God sayd: let there be a fyrmament betwene the waters ad let it devyde the waters a sonder.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 7, 'Than God made the fyrmament and parted the waters which were vnder the fyrmament from the waters that were above the fyrmament: And it was so.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 8, 'And God called the fyrmament heaven And so of the evenynge and morninge was made the seconde daye');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 9, 'And God sayd let the waters that are vnder heaven gather them selves vnto one place that the drye londe may appere: And it came so to passe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 10, 'And god called the drye lande the erth and the gatheringe togyther of waters called he the see. And God sawe that it was good');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 11, 'And God sayd: let the erth bringe forth herbe and grasse that sowe seed and frutefull trees that bere frute every one in his kynde havynge their seed in them selves vpon the erth. And it came so to passe:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 12, 'ad the erth brought forth herbe and grasse sowenge seed every one in his kynde and trees berynge frute and havynge their seed in the selves every one in his kynde. And God sawe that it was good:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 13, 'and the of the evenynge and mornynge was made the thyrde daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 14, 'Than sayd God: let there be lyghtes in ye firmament of heaven to devyde the daye fro the nyghte that they may be vnto sygnes seasons days and yeares.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 15, 'And let them be lyghtes in the fyrmament of heave to shyne vpon the erth. and so it was.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 16, 'And God made two great lyghtes A greater lyghte to rule the daye and a lesse lyghte to rule the nyghte and he made sterres also.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 17, 'And God put them in the fyrmament of heaven to shyne vpon the erth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 18, 'and to rule the daye and the nyghte ad to devyde the lyghte from darcknesse. And god sawe yt it was good:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 19, 'and so of the evenynge ad mornynge was made the fourth daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 20, 'And God sayd let the water bryng forth creatures that move and have lyfe and foules for to flee over the erth vnder the fyrmament of heaven.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 21, 'And God created greate whalles and all maner of creatures that lyve and moue which the waters brought forth in their kindes ad all maner of federed foules in their kyndes. And God sawe that it was good:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 22, 'and God blessed them saynge. Growe and multiplye ad fyll the waters of the sees and let the foules multiplye vpo the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 23, 'And so of the evenynge and morninge was made the fyfth daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 24, 'And God sayd: leth the erth bring forth lyvynge creatures in thir kyndes: catell and wormes and beastes of the erth in their kyndes and so it came to passe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 25, 'And god made the beastes of the erth in their kyndes and catell in their kyndes ad all maner wormes of the erth in their kyndes: and God sawe that it was good.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 26, 'And God sayd: let vs make man in oure symilitude ad after oure lycknesse: that he may have rule over the fysh of the see and over the foules of the ayre and over catell and over all the erth and over all wormes that crepe on the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 27, 'And God created man after hys lycknesse after the lycknesse of god created he him: male and female created he them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 28, 'And God blessed them and God sayd vnto them. Growe and multiplye and fyll the erth and subdue it and have domynyon over the fysh of the see and over the foules of the ayre and over all the beastes that move on the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 29, 'And God sayd: se I have geven yow all herbes that sowe seed which are on all the erth and all maner trees that haue frute in them and sowe seed: to be meate for yow');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 30, 'and for all beastes of the erth and vnto all foules of the ayre and vnto all that crepeth on the erth where in is lyfe that they may haue all maner herbes and grasse for to eate and even so it was.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 1, 31, 'And God behelde al that he had made ad loo they were exceadynge good: and so of the evenynge and mornynge was made the syxth daye');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 1, 'Thus was heave and erth fynished wyth all their apparell:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 2, 'ad i ye seueth daye god ended hys worke which he had made and rested in ye seventh daye fro all his workes which he had made.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 3, 'And God blessed ye seventh daye and sanctyfyed it for in it he rested from all his workes which he had created and made.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 4, 'These are the generations of heaven and erth when they were created in the tyme when the LORde God created heaven and erth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 5, 'and all the shrubbes of the felde be fore they were in the erthe. And all the herbes of the felde before they sprange: for the LORde God had yet sent no rayne vpon the erth nether was there yet any man to tylle the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 6, 'But there arose a myste out of the ground and watered all the face of the erth:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 7, 'Then the LORde God shope man even of the moulde of the erth and brethed into his face the breth of lyfe. So man was made a lyvynge soule.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 8, 'The LORde God also planted a garden in Eden from the begynnynge and there he sette man whom he had formed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 9, 'And the LORde God made to sprynge out of the erth all maner trees bewtyfull to the syghte and pleasant to eate and the tree of lyfe in the middes of the garden: and also the tree of knowlege of good and euell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 10, 'And there spronge a rever out of Eden to water the garden and thence devided it selfe and grewe in to foure principall waters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 11, 'The name of the one is Phison he it is that compasseth all the lande of heuila where gold groweth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 12, 'And the gold of that contre ys precious there is found bedellion and a stone called Onix.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 13, 'The name of the seconde ryver is Gihon which compassyth all the lande of Inde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 14, 'And the name of the thyrde river is Hidekell which runneth on the easte syde of the assyryans And the fourth river is Euphrates.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 15, 'And the LORde God toke Adam and put him in the garden of Eden to dresse it and to kepe it:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 16, 'and the LORde God comaunded Ada saynge: of all the trees of the garde se thou eate.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 17, 'But of the tre of knowlege of good and badd se that thou eate not: for even ye same daye thou eatest of it thou shalt surely dye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 18, 'And the LORde God sayd: it is not good that man shulde be alone I will make hym an helper to beare him company:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 19, 'And after yt the LORde God had make of the erth all maner beastes of the felde and all maner foules of the ayre he brought them vnto Adam to see what he wold call them. And as Ada called all maner livynge beastes: eve so are their names.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 20, 'And Adam gave names vnto all maner catell and vnto the foules of the ayre and vnto all maner beastes of the felde. But there was no helpe founde vnto Adam to beare him companye');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 21, 'Then the LORde God cast a slomber on Adam and he slepte. And then he toke out one of his rybbes and in stede ther of he fylled vp the place with flesh.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 22, 'And the LORde God made of the rybbe which he toke out of Adam a woma and brought her vnto Adam.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 23, 'Then sayd Ada this is once bone of my boones and flesh of my flesh. This shall be called woman: because she was take of the man.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 24, 'For this cause shall a man leve father and mother and cleve vnto his wyfe and they shall be one flesh.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 2, 25, 'And they were ether of them naked both Adam and hys wyfe ad were not ashamed:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 1, 'But the serpent was sotyller than all the beastes of the felde which ye LORde God had made and sayd vnto the woman. Ah syr that God hath sayd ye shall not eate of all maner trees in the garden.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 2, 'And the woman sayd vnto the serpent of the frute of the trees in the garden we may eate');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 3, 'but of the frute of the tree yt is in the myddes of the garden (sayd God) se that ye eate not and se that ye touch it not: lest ye dye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 4, 'Then sayd the serpent vnto the woman: tush ye shall not dye:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 5, 'But God doth knowe that whensoever ye shulde eate of it youre eyes shuld be opened and ye shulde be as God and knowe both good and evell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 6, 'And the woman sawe that it was a good tree to eate of and lustie vnto the eyes and a pleasant tre for to make wyse. And toke of the frute of it and ate and gaue vnto hir husband also with her and he ate.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 7, 'And the eyes of both them were opened that they vnderstode how that they were naked. Than they sowed fygge leves togedder and made them apurns.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 8, 'And they herd the voyce of the LORde God as he walked in the garde in the coole of the daye. And Adam hyd hymselfe and his wyfe also from the face of the LORde God amonge the trees of the garden.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 9, 'And the LORde God called Adam and sayd vnto him where art thou?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 10, 'And he answered. Thy voyce I harde in the garden but I was afrayd because I was naked and therfore hyd myselfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 11, 'And he sayd: who told the that thou wast naked? hast thou eaten of the tree of which I bade the that thou shuldest not eate?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 12, 'And Adam answered. The woman which thou gavest to bere me company she toke me of the tree ad I ate.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 13, 'And the LORde God sayd vnto the woman: wherfore didest thou so? And the woman answered the serpent deceaved me and I ate.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 14, 'And the LORde God sayd vnto the serpet because thou haste so done moste cursed be thou of all catell and of all beastes of the feld: vppo thy bely shalt thou goo: and erth shalt thou eate all dayes of thy lyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 15, 'Morover I will put hatred betwene the and the woman and betwene thy seed and hyr seed. And that seed shall tread the on the heed ad thou shalt tread hit on the hele.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 16, 'And vnto the woman he sayd: I will suerly encrease thy sorow ad make the oft with child and with payne shalt thou be deleverd: And thy lustes shall pertayne vnto thy husbond and he shall rule the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 17, 'And vnto Ada he sayd: for as moch as thou hast obeyed the voyce of thy wyfe and hast eaten of the tree of which I commaunded the saynge: se thou eate not therof: cursed be the erth for thy sake. In sorow shalt thou eate therof all dayes of thy lyfe');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 18, 'And it shall beare thornes ad thystels vnto the. And thou shalt eate the herbes of ye feld:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 19, 'In the swete of thy face shalt thou eate brede vntill thou returne vnto the erth whece thou wast take: for erth thou art ad vnto erth shalt thou returne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 20, 'And Ada called his wyfe Heua because she was the mother of all that lyveth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 21, 'And the LORde God made Adam and hys wyfe garmentes of skynnes and put them on them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 22, 'And the LORde God sayd: loo Adam is become as it were one of vs in knowlege of good and evell. But now lest he strech forth his hand and take also of the tree of lyfe and eate and lyve ever.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 23, 'And the LORde God cast him out of the garden of Eden to tylle the erth whece he was taken.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 3, 24, 'And he cast Ada out and sette at ye enteringe of the garden Eden Cherubin with a naked swerde movinge in and out to kepe the way to the tree of lyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 1, 'And Adam lay wyth Heua ys wyfe which conceaved and bare Cain and sayd: I haue goten a ma of the LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 2, 'And she proceded forth and bare hys brother Abell: And Abell became a sheperde And Cain became a ploweman.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 3, 'And it fortuned in processe of tyme that Cain brought of the frute of the erth: an offerynge vnto the LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 4, 'And Abell he brought also of the fyrstlynges of hys shepe and of the fatt of them. And the LORde loked vnto Abell and to his offeynge:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 5, 'but vnto Cain and vnto his offrynge looked he not. And Cain was wroth exceadingly and loured.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 6, 'And the LORde sayd vnto Cain: why art thou angry and why loureste thou? Wotest thou not yf thou dost well thou shalt receave it?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 7, 'But and yf thou dost evell by and by thy synne lyeth open in the dore. Not withstondyng let it be subdued vnto the ad see thou rule it.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 8, 'And Cain talked wyth Abell his brother.And as soone as they were in the feldes Cain fell vppon Abell his brother and slewe hym');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 9, 'And ye LORde sayd vnto Cain: where is Abell thy brother? And he sayd: I can not tell am I my brothers keper?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 10, 'And he sayd: What hast thou done? the voyce of thy brothers bloud cryeth vnto me out of the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 11, 'And now cursed be thou as pertaynyng to the erth which opened hyr mouth to receaue thy brothers bloud of thyne hande.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 12, 'For when thou tyllest the grounde she shall heceforth not geve hyr power vnto the. A vagabunde and a rennagate shalt thou be vpon the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 13, 'And Cain sayd vnto the LORde: my synne is greater then that it may be forgeven.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 14, 'Beholde thou castest me out thys day from of the face of the erth and fro thy syghte must I hyde my selfe ad I must be wandrynge and a vagabunde vpon the erth: Morover whosoever fyndeth me wyll kyll me,');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 15, 'And the LORde sayd vnto hi Not so but whosoever sleyth Cain shalbe punyshed .vij. folde. And ye LORde put a marke vpo Cain that no ma yt founde hym shulde kyll hym.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 16, 'And Cain went out fro the face of the LORde and dwelt in the lande Nod on the east syde of Eden.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 17, 'And Cain laye wyth hys wyfe which conceaved and bare Henoch. And he was buyldinge a cyte and called the name of it after the name of hys sonne Henoch.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 18, 'And Henoch begat Irad. And Irad begat Mahuiael. And Mahuiael begat Mathusael. And Mathusael begat Lamech.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 19, 'And Lamech toke hym two wyves: the one was called Ada and the other Zilla.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 20, 'And Ada bare Iabal of whome came they that dwell in tentes ad possesse catell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 21, 'And hys brothers name was Iubal: of hym came all that excercyse them selves on the harpe and on the organs');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 22, 'And Zilla she also bare Tubalcain a worker in metall and a father of all that grave in brasse and yeron. And Tubalcains syster was called Naema.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 23, 'Then sayd Lamech vnto hys wyves Ada ad Zilla: heare my voyce ye wyves of Lamech and herken vnto my wordes for I haue slayne a man and wounded my selfe and haue slayn a yongman and gotte my selfe strypes:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 24, 'For Cain shall be avenged sevenfolde: but Lamech seventie tymes sevenfolde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 25, 'Adam also laye with hys wyfe yet agayne and she bare a sonne ad called hys name Seth For god (sayd she) hath geven me a nother sonne For Abell whom Cain slewe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 4, 26, 'And Seth begat a sonne and called hys name Enos. And in that tyme began men to call on the name of the LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 1, 'Thys is the boke of the generacion of man In the daye when God created man and made hym after the symilytude of god');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 2, 'Male and female made he the and called their names man in the daye when they were created.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 3, 'And when Adam was an hundred and thyrty yere old he begat a sonne after hys lycknesse and symilytude: and called hys name Seth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 4, 'And the dayes of Adam after he begat Seth were eyght hundred yere and begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 5, 'and all the dayes of Adam which he lyved were .ix. hundred and .xxx. yere and then he dyed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 6, 'And Seth lyved an hundred and .v. yeres and begat Enos.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 7, 'And after he had begot Enos he lyved .viij. hundred and .vij. yere and begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 8, 'And all the dayes of Seth were .ix. hundred and .xij. yere and dyed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 9, 'And Enos lyved .lxxxx. yere and begat kenan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 10, 'And Enos after he begat kenan lyved viij. hundred and .xv. yere and begat sonnes and doughters:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 11, 'and all the dayes of Enos were .ix hundred and .v. yere and than he dyed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 12, 'And kenan lyued .lxx. yere and begat Mahalaliel.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 13, 'And kenan after he had begot Mahalaliel lyved .viij. hundred and .xl. yere and begat sonnes and doughters:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 14, 'and al the dayes of kenan were .ix. hundred and .x. yere and than he dyed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 15, 'And Mahalaliel lyued .lxv. yere and begat Iared.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 16, 'And Mahalaliel after he had begot Iared lyved .viij. hundred and .xxx. yere and begat sonnes and doughters:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 17, 'and all the dayes of Mahalalyell were .viij. hundred nynetye and .v. yeare and than he dyed');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 18, 'And Iared lyved an hundred and .lxij. yere and begat Henoch:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 19, 'and Iared lyved after he begat Henoch .viij. hundred yere and begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 20, 'And all the dayes of Iared were .ix. hundred and .lxij. yere and than he dyed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 21, 'And Henoch lyved .lxv. yere ad begat Mathusala.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 22, 'And Henoch walked wyth god after he had begot Mathusala .iij. hundred yere and begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 23, 'And all the dayes of Henoch were .iij. hundred and .lxv. yere.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 24, 'and than Henoch lyved a godly lyfe and was nomore sene for God toke hym away.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 25, 'And Mathusala lyved an hundred and lxxxvij. yere and begat Lamech:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 26, 'and Mathusala after he had begot Lamech lyved .vij. hundred and .lxxxij. yere ad begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 27, 'And all the dayes of Methusala were .ix. hundred .lxix yere and than he dyed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 28, 'And Lamech lyved an hundred .lxxxij. yere and begat a sonne');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 29, 'and called hym Noe sayng. This same shall comforte vs: as concernynge oure worke and sorowe of oure handes which we haue aboute the erthe that the LORde hath cursed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 30, 'And Lamech lyved after he had begot Noe v. hundred nynetie and .v. yere and begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 31, 'And all the dayes of Lamech were .vij. hundred .lxxvij. yere and than he dyed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 5, 32, 'And when Noe was .v. hundred yere olde he begat Sem Ham and Iaphet.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 1, 'And it came to passe wha men bega to multiplye apo the erth ad had begot them doughters');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 2, 'the sonnes of God sawe the doughters of men that they were fayre and toke vnto them wyves which they best liked amoge the all.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 3, 'And the LORd sayd: My spirite shall not allwaye stryve withe man for they are flesh. Nevertheles I wyll geue them yet space and hundred and .xx. yeres');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 4, 'There were tirantes in the world in thos dayes. For after that the children of God had gone in vnto the doughters of men and had begotten them childern the same childern were the mightiest of the world and men of renowne');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 5, 'And whan the LORde sawe yt the wekednesse of man was encreased apon the erth and that all the ymaginacion and toughtes of his hert was only evell continually');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 6, 'he repented that he had made man apon the erth and sorowed in his hert.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 7, 'And sayd: I wyll destroy mankynde which I haue made fro of the face of the erth: both man beast worme and foule of the ayre for it repeteth me that I haue made them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 8, 'But yet Noe found grace in the syghte of the LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 9, 'These are the generatios of Noe. Noe was a righteous man and vncorrupte in his tyme and walked wyth god.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 10, 'And Noe begat .iij. sonnes: Sem Ham and Iapheth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 11, 'And the erth was corrupte in the syghte of god and was full of mischefe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 12, 'And God loked vpon the erth ad loo it was corrupte: for all flesh had corrupte his way vppon the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 13, 'Than sayd God to Noe: the end of all flesh is come before me for the erth is full of there myschefe. And loo I wyll destroy them with the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 14, 'Make the an arcke of pyne tree and make chaumbers in the arcke and pytch it wythin and wythout wyth pytch.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 15, 'And of this facion shalt thou make it.The lenth of the arcke shall be .iij. hundred cubytes ad the bredth of it .l. cubytes and the heyth of it .xxx. cubytes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 16, 'A wyndow shalt thou make aboue in the arcke. And wythin a cubyte compasse shalt thou finysh it.And the dore of the arcke shalt thou sette in ye syde of it: and thou shalt make it with .iij loftes one aboue an other.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 17, 'For behold I wil bringe in a floud of water apon the erth to destroy all flesh from vnder heaven wherin breth of life is so that all that is in the erth shall perish.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 18, 'But I will make myne apoyntement with the that both thou shalt come in to ye arcke and thy sonnes thy wyfe and thy sonnes wyves with the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 19, 'And of all that lyveth what soever flesh it be shalt thou brynge in to the arcke of every thynge a payre to kepe them a lyve wyth the. And male and female');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 20, 'se that they be of byrdes in their kynde and of beastes in their kynde and of all maner of wormes of the erth in their kinde: a payre of every thinge shall come vnto the to kepe them a lyve.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 21, 'And take vnto the of all maner of meate yt may be eaten and laye it vp in stoore by the that it may be meate both for ye and for the:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 6, 22, 'and Noe dyd acordynge to all that God commaunded hym.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 1, 'And the LORde sayd vnto Noe: goo in to the arcke both thou and all thy houssold. For the haue I sene rightuous before me in thys generacion.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 2, 'Of all clene beastes take vnto the .vij. of every kynde the male and hys female And of vnclene beastes a payre the male and hys female:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 3, 'lykewyse of the byrdes of the ayre vij. of every kynde male and female to save seed vppon all the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 4, 'For .vij. dayes hence wyll I send rayne vppo the erth .xl. dayes and .xl. nyghtes and wyll dystroy all maner of thynges that I haue made from of the face of the erth..');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 5, 'And Noe dyd acordynge to all yt the lorde comaunded hym:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 6, 'and Noe was .vi. hundred yere olde when the floud of water came vppon the erth:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 7, 'and Noe went and his sonnes and his wyfe and his sonnes wyves wyth hym in to the arke from the waters of the floud.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 8, 'And of clene beastes and of beastes that ware vnclene and of byrdes and of all that crepeth vppo the erth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 9, 'came in by cooples of every kynde vnto Noe in to the arke: a male and a female: even as God commaunded Noe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 10, 'And the seventh daye the waters of the floud came vppon the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 11, 'In the .vi. hundred yere of Noes lyfe in the secode moneth in the .xvij daye of the moneth yt same daye were all the founteynes of the grete depe broken vp and the wyndowes of heave were opened');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 12, 'ad there fell a rayne vpon the erth .xl. dayes and .xl. nyghtes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 13, 'And the selfe same daye went Noe Sem Ham and Iapheth Noes sonnes and Noes wyfe and the .iij. wyues of his sonnes wyth them in to the arke:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 14, 'both they and all maner of beastes in their kide and all maner of catell in their kynde and all maner of wormes that crepe vppon the erth in their kynde and all maner of byrdes in there kynde. and all maner off foules what soever had feders.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 15, 'And they came vnto Noe in to the arke by cooples of all flesh yt had breth of lyfe in it.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 16, 'And they that came came male ad female of every flesh acordige as God comaunded hym: and ye LORde shytt the dore vppo him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 17, 'And the floud came .xl. dayes and .xl. nyghtes vppon the erth and the water increased and bare vp the arcke ad it was lifte vp from of the erth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 18, 'And the water prevayled and increased exceadingly vppon the erth: and the arke went vppo he toppe of the waters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 19, 'And the waters prevayled excedingly above mesure vppo the erth so that all the hye hylles which are vnder all the partes of heaven were covered:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 20, 'eve .xv. cubytes hye prevayled the waters so that the hylles were covered.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 21, 'And all fleshe that moved on the erth bothe birdes catell and beastes perisshed with al that crepte on the erth and all men:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 22, 'so that all that had the breth of liffe in the nostrels of it thorow out all that was on drye lond dyed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 23, 'Thus was destroyed all that was vppo the erth both man beastes wormes and foules of the ayre so that they were destroyed from the erth: save Noe was reserved only and they that were wyth hym in the arke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 7, 24, 'And the waters prevayled vppon the erth an hundred and fyftye dayes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 1, 'And god remebred Noe and all ye beastes and all ye catell yt were with hi in ye arke And god made a wynde to blow vppo ye erth and ye waters ceased:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 2, 'ad ye fountaynes of the depe ad the wyndowes of heave were stopte and the rayne of heaven was forbidde');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 3, 'and the waters returned from of ye erth ad abated after the ende of an hundred and .l. dayes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 4, 'And the arke rested vppo the mountayns of Ararat the .xvij. daye of the .vij. moneth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 5, 'And the waters went away ad decreased vntyll the x. moneth. And the fyrst daye of the tenth moneth the toppes of the mounteyns appered.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 6, 'And after the ende of .xl. dayes. Noe opened the wyndow of the arke which he had made');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 7, 'ad sent forth a raven which went out ever goinge and cominge agayne vntyll the waters were dreyed vpp vppon the erth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 8, 'Then sent he forth a doue from hym to wete whether the waters were fallen from of the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 9, 'And when the doue coude fynde no restinge place for hyr fote she returned to him agayne vnto the arke for the waters were vppon the face of all the erth. And he put out hys honde and toke her and pulled hyr to hym in to the arke');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 10, 'And he abode yet .vij. dayes mo and sent out the doue agayne out of the arke');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 11, 'And the doue came to hym agayne aboute eventyde and beholde: There was in hyr mouth a lefe of an olyve tre which she had plucked wherby Noe perceaved that the waters wer abated vppon the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 12, 'And he taried yet .vij. other dayes and sent forth the doue which from thence forth came no more agayne to him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 13, 'And it came to passe the syxte hundred and one yere and the fyrst daye of the fyrst moneth that the waters were dryed vpp apon the erth. And Noe toke off the hatches of the arke and loked: And beholde the face of the erth was drye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 14, 'so by the .xxvij. daye of the seconde moneth the erth was drye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 15, 'And God spake vnto Noe saynge:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 16, 'come out of the arcke both thou and thy wyfe ad thy sonnes and thy sonnes wyues with the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 17, 'And all the beastes that are with the whatsoever flesh it be both foule and catell and all maner wormes that crepe on the erth brynge out with the and let them moue growe ad multiplye vppon the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 18, 'And Noe came out ad his sonnes and his wyfe and his sonnes wyues with hym.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 19, 'And all the beastes and all the wormes and all the foules and all that moved vppon the erth came also out of the arke all of one kynde together.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 20, 'And Noe made an aulter vnto the LORDE and toke of all maner of clene beastes and all maner of clene foules and offred sacrifyce vppon the aulter.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 21, 'And the LORDE smellyd a swete savoure and sayd in his hert: I wyll henceforth no more curse the erth for mannes sake for the imagynacion of mannes hert is evell even from the very youth of hym. Morover I wyll not destroy from henceforth all that lyveth as I haue done.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 8, 22, 'Nether shall sowynge tyme and harvest colde and hete somere and wynter daye and nyghte ceasse as longe as the erth endureth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 1, 'And God blessed Noe and his sonnes and sayd vnto them: Increase and multiplye and fyll the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 2, 'The feare also and drede of yow be vppon all beastes of the erth and vppon all foules of the ayre ad vppon all that crepeth on the erth and vppon all fyshes of the see which are geven vnto youre handes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 3, 'And all that moveth vppon the erth havynge lyfe shall be youre meate: Euen as ye grene herbes so geue I yow all thynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 4, 'Only the flesh with his life which is his bloud se that ye eate not.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 5, 'For verely the bloude of yow wherein youre lyves are wyll I requyre: Eue of the hande of all beastes wyll I requyre it And of the hande of man and of the hand off euery mannes brother wyll I requyre the lyfe of man:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 6, 'so yt he which shedeth mannes bloude shall haue hys bloud shed by man agayne: for God made man after his awne lycknesse.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 7, 'See that ye encrease and waxe and be occupyde vppon the erth and multiplye therein.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 8, 'Farthermore God spake vnto Noe and to hys sonnes wyth hym saynge:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 9, 'see I make my bod wyth you and youre seed after you');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 10, 'and wyth all lyvynge thinge that is wyth you: both foule and catell and all maner beste of the erth that is wyth yow of all that commeth out of the arke what soeuer beste of the erth it be.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 11, 'I make my bonde wyth yow that hence forth all flesh shall not be destroyed wyth yt waters of any floud ad yt hence forth there shall not be a floud to destroy the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 12, 'And God sayd. This is the token of my bode which I make betwene me and yow ad betwene all lyvynge thyng that is with yow for ever:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 13, 'I wyll sette my bowe in the cloudes and it shall be a sygne of the appoyntment made betwene me and the erth:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 14, 'So that when I brynge in cloudes vpo ye erth the bowe shall appere in ye cloudes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 15, 'And than wyll I thynke vppon my testament which I haue made betwene me and yow and all that lyveth what soeuer flesh it be. So that henceforth there shall be no more waters to make a floud to destroy all flesh.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 16, 'The bowe shalbe in the cloudes and I wyll loke vpon it to remembre the euerlastynge testament betwene God and all that lyveth vppon the erth what soeuer flesh it be.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 17, 'And God sayd vnto Noe: This is the sygne of the testament which I have made betwene me and all flesh yt is on the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 18, 'The sonnes of Noe that came out of the arke were: Sem Ham and Iapheth. And Ham he is the father of Canaa.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 19, 'These are the .iij. sonnes of Noe and of these was all the world overspred.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 20, 'And Noe beynge an husbad man went furth and planted a vyneyarde');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 21, 'and drancke of the wyne and was droncke and laye vncouered in the myddest of his tet.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 22, 'And Ham the father of Canaan sawe his fathers prevytees and tolde his ij. brethren that were wythout.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 23, 'And Sem and Iapheth toke a mantell and put it on both there shulders ad went backward ad covered there fathers secrets but there faces were backward So that they sawe not there fathers nakydnes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 24, 'As soone as Noe was awaked fro his wyne and wyst what his yongest sonne had done vnto hym');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 25, 'he sayd: cursed be Canaan ad a seruante, of all seruantes be he to his brethren.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 26, 'And he sayd: Blessed be the LORde God of Se and Canaan be his seruante.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 27, 'God increase Iapheth that he may dwelle in the tentes of Sem. And Canaan be their seruante.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 28, 'And Noe lyved after the floude .iij. hundred and .l. yere: So that all the dayes of Noe were ix. hundred and .l. yere ad than he dyed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 9, 29, '');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 1, 'These are the generations of the sonnes of Noe: of Sem Ham and Iapheth which begat them children after the floude.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 2, 'The sonnes of Iapheth were: Gomyr Magog Madai Iauan Tuball Mesech and Thyras.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 3, 'And the sonnes of Gomyr were: Ascenas Riphat and Togarina.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 4, 'And the sonnes of Iauan were: Elisa Tharsis Cithun and Dodanim.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 5, 'Of these came the Iles of the gentylls in there contres every man in his speach kynred and nation.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 6, 'The sonnes of Ham were: Chus Misraim Phut and Canaan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 7, 'The sonnes of Chus: were Seba Hevila Sabta Rayma and Sabtema. And the sonnes of Rayma were: Sheba and Dedan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 8, 'Chus also begot Nemrod which bega to be myghtye in the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 9, 'He was a myghtie hunter in the syghte of the LORde: Where of came the proverbe: he is as Nemrod that myghtie hunter in the syghte of the LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 10, 'And the begynnynge of hys kyngdome was Babell Erech Achad and Chalne in the lande of Synear:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 11, 'Out of that lande came Assur and buylded Ninyue and the cyte rehoboth and Calah');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 12, 'And Ressen betwene Ninyue ad Chalah. That is a grete cyte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 13, 'And Mizraim begat Iudun Enamim Leabim Naphtuhim');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 14, 'Pathrusim and Castuhim: from whence came the Philystyns and the Capthiherynes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 15, 'Canaan also begat zidon his eldest sonne and Heth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 16, 'Iebusi Emori Girgosi');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 17, 'Hiui Arki Sini');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 18, 'Aruadi Zemari and hamari. And afterward sprange the kynreds of the Canaanytes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 19, 'And the costes of the Canaanytes were fro Sydon tyll thou come to Gerara and to Asa and tyll thou come to Sodoma Gomorra Adama Zeboim: eve vnto Lasa.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 20, 'These were the chyldre of Ham in there kynreddes tonges landes and nations.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 21, 'And Sem the father of all ye childre of Eber and the eldest brother of Iapheth begat children also.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 22, 'And his sonnes were: Elam Assur Arphachsad Lud ad Aram.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 23, 'And ye childree of Aram were: Vz Hul Gether and Mas');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 24, 'And Arphachsad begat Sala and Sala begat Eber.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 25, 'And Eber begat .ij. sonnes. The name of the one was Peleg for in his tyme the erth was devyded. And the name of his brother was Iaketanr');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 26, 'Iaketan begat Almodad Saleph Hyzarmoneth Iarah');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 27, 'Hadoram Vsal Dikela');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 28, 'Obal Abimach Seba');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 29, 'Ophir Heuila and Iobab. All these are the sonnes of Iaketan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 30, 'And the dwellynge of them was from Mesa vntill thou come vnto Sephara a mountayne of the easte lande.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 31, 'These are the sonnes o Sem in their kynreddes languages contrees and nations.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 10, 32, 'These are the kynreddes of the sonnes of Noe in their generations and nations. And of these came the people that were in the world after the floude.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 1, 'And all the world was of one tonge and one language.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 2, 'And as they came from the east they founde a playne in the lande of Synear and there they dwelled.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 3, 'And they sayd one to a nother: come on let us make brycke ad burne it wyth fyre. So brycke was there stone and slyme was there morter');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 4, 'And they sayd: Come on let vs buylde vs a cyte and a toure that the toppe may reach vnto heauen. And let vs make us a name for perauenture we shall be scatered abrode over all the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 5, 'And the LORde came downe to see the cyte and the toure which the childern of Ada had buylded.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 6, 'And the LORde sayd: See the people is one and haue one tonge amonge them all. And thys haue they begon to do and wyll not leaue of from all that they haue purposed to do.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 7, 'Come on let vs descende and myngell theire tonge even there that one vnderstonde not what a nother sayeth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 8, 'Thus ye LORde skatered them from thence vppon all the erth. And they left of to buylde the cyte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 9, 'Wherfore the name of it is called Babell because that the LORDE there confounded the tonge of all the world. And because that the LORde from thence skatered them abrode vppon all the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 10, 'These are the generations of Sem: Se was an hundred yere olde and begat Arcphachsad ij. yere after the floude.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 11, 'And Se lyved after he had begot Arphachsad .v. hundred yere an begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 12, 'And Arphacsad lyued .xxxv. yere and begat Sala');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 13, 'and lyved after he had begot Sala iiij. hudred yere and .iij and begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 14, 'And Sala was .xxx. yere old and begat Eber');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 15, 'ad lyued after he had begot Eber .iiij. hudred and thre yere ad begat sonnes and doughters');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 16, 'When Eber was .xxxiiij. yere olde he begat Peleg');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 17, 'and lyued after he had begot Peleg foure hundred and .xxx. yere and begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 18, 'And Peleg when he was .xxx. yere olde begat Regu');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 19, 'and lyued after he had begot Regu. ij. hundred and .ix. yere and begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 20, 'And Regu when he had lyued .xxxij. yere begat Serug');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 21, 'and lyued after he had begot Serug .ij. hundred and .vij. yere and begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 22, 'And when Serug was .xxx. yere olde he begat Nahor');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 23, 'and lyued after he had begot Nahor .ij. hundred yere and begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 24, 'And Nahor when he was .xxix. yere olde begat Terah');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 25, 'and lyved after he had begot Terah an hundred and .xix. yere and begat sonnes and doughters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 26, 'And when Terah was .lxx. yere olde he begat Abram Nahor and Haran.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 27, 'And these are the generations of Terah. Terah begat Abram Nahor and Haran. And Haran begat Lot.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 28, 'And Haran dyed before Terah his father in the londe where he was borne at Vr in Chaldea.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 29, 'And Abram and Nahor toke them wyves. Abras wyfe was called Sarai. And Nahors wyfe Mylca the doughter of Haran which was father of Milca ad of Iisca.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 30, 'But Sarai was baren and had no childe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 31, 'Than toke Terah Abram his sonne and Lot his sonne Harans sonne and Sarai his doughter in lawe his sone Abrams wyfe. And they went wyth hym from Vr in Chaldea to go in to the lade of Chanaan. And they came to Haran and dwelled there.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 11, 32, 'And when Terah was ij. hundred yere old and .v. he dyed in Haran.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 1, 'Then the LORde sayd vnto Abra Gett the out of thy contre and from thy kynred and out of thy fathers house into a londe which I wyll shewe the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 2, 'And I wyll make of the a myghtie people and wyll blesse the and make thy name grete that thou mayst be a blessinge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 3, 'And I wyll blesse the that blesse the ad curse the that curse the. And in the shall be blessed all the generations of the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 4, 'And Abram wet as the LORde badd hym and Lot went wyth him. Abram was .lxxv. yere olde when he went out of Haran.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 5, 'And Abram toke Sarai his wyfe ad Lot his brothers sonne wyth all their goodes which they had goten and soulles which they had begoten in Haran. And they departed to goo in to the lade of Chanaan. And when they were come in to the lande of Chanaan');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 6, 'Abram went furth in to the lade tyll he came vnto a place called Sychem and vnto the oke of More. And the Canaanytes dwelled then in the lande.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 7, 'Then the LORde apeared vnto Abram ad sayd: vnto thy seed wyll I geue thys lade. And he buylded an aultere there vnto the LORDE which apeared to hym.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 8, 'Then departed he thence vnto a mountayne that lyeth on the east syde of BETHEL and pytched hys tente: BETHEL beynge on the west syde and Ay on the east: And he buylded there an aulter vnto the LORde and called on the name of ye LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 9, 'And than Abram departed and toke his iourney southwarde');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 10, 'After thys there came a derth in the lande. And Abram went doune in to Egipte to soiourne there for the derth was sore in the lande.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 11, 'And when he was come nye for to entre in to Egipte he sayd vnto sarai his wife. Beholde I knowe that thou art a fayre woman to loke apo.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 12, 'It wyll come to passe therfore whe the Egiptians see the that they wyll say: she is his wyfe. And so shall they sley me and save the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 13, 'saye I praye the therfore that thou art my sister that I maye fare the better by reason of the and that my soule maye lyue for thy sake.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 14, 'As soone as he came in to Egipte the Egiptias sawe the woman that she was very fayre.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 15, 'And Pharaos lordes sawe hir also and praysed hir vnto Pharao: So that she was taken in to Pharaos house');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 16, 'which entreated Abram well for hir sake so that he had shepe oxsen ad he asses men seruantes mayde seruates she asses and camels.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 17, 'But God plaged Pharao and his house wyth grete plages because of Sarai Abrams wyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 18, 'Then Pharao called Abram and sayd: why hast thou thus dealt with me? Wherfore toldest thou me not that she was thy wyfe?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 19, 'Why saydest thou that she was thy sister and causedest me to take hyr to my wyfe? But now loo there is the wife take hir ad be walkynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 12, 20, 'Pharao also gaue a charge vnto his men over Abram to leade hym out wyth his wyfe and all that he had.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 1, 'Than Abram departed out of Egipte both he and his wyfe and all that he had and Lot wyth hym vnto the south.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 2, 'Abram was very rych in catell syluer and gold.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 3, 'And he went on his iourney fro the south even vnto BETHEL ad vnto the place where his tente was at the fyrst tyme betwene BETHEL and Ay');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 4, 'and vnto the place of the aulter which he made before. And there called Abram vpon the name of the LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 5, 'Lot also which went wyth hym had shepe catell and tentes:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 6, 'so that the londe was not abill to receaue them that they myght dwell together for the substance of their riches was so greate that they coude not dwell together');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 7, 'And there fell a stryfe betwene the herdmen of Abrams catell and the herdmen of Lots catell. Moreouer the Cananytes and the Pherysites dwelled at that tyme in the lande.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 8, 'Than sayd Abram vnto Lot: let there be no stryfe I praye the betwene the and me and betwene my herdmen and thyne for we be brethren.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 9, 'Ys not all the hole lande before the? Departe I praye the fro me. Yf thou wylt take the lefte hande I wyll take the right: Or yf thou take the right hande I wyll take the left.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 10, 'And Lot lyft vp hys eyes and beheld all the contre aboute Iordane which was a plenteous contre of water every where before the LORde destroyed Sodoma and Gomorra.Even as the garden of the LORde and as the lande of Egipte tyll thou come to Zoar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 11, 'Than Lot chose all the costes of Iordane ad toke hys iourney from the east. And so departed the one brother from the other.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 12, 'Abram dwelled in the lande of Canaan. And lot in the cytes of the playne and tented tyll he came to Sodome.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 13, 'But the men of sodome were wyked and synned exceadyngly agenst the LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 14, 'And the LORde sayed vnto Abram after that Lot was departed from hym: lyfte vp thyne eyes and loke from ye place where thou art northward southward eastward and westward');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 15, 'for all the lande which thou seiste wyll I gyue vnto the and to thy seed for ever.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 16, 'And I wyll make thy seed as the dust of the erth: so that yf a ma can nombre the dust of the erth than shall thy seed also be nombred.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 17, 'Aryse and walke aboute in the lande in the length of it ad in the bredth for I wyll geue it vnto the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 13, 18, 'Than Abra toke downe hys tente and went and dwelled in the okegrove of Mamre which is in Ebron and buylded there an altar to the LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 1, 'And it chaunsed within a while that Amraphel kynge of Synear Arioch kynge of Ellasar Kedorlaomer kynge of Elam and Thydeall kynge of the nations:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 2, 'made warre wyth Bera kynge of Sodoh and with Birsa kynge of Gomorra. And wythe Sineab kynge of Adama and with Semeaber kynge of Zeboim and wyth the kynge of Bela Which Bela is called Zoar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 3, 'All these came together vnto the vale of siddim which is now the salt see');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 4, 'Twelve yere were they subiecte to kinge kedorlaomer and in the .xiij. yere rebelled.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 5, 'Therfore in the .xiiij. yere came kedorlaomer and the kynges that were wyth hym and smote the Raphayms in Astarath Karnaim and the Susims in Hain ad the Emyms in Sabe Kariathaim');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 6, 'and the Hozyms in their awne mounte Seir vnto the playne of Pharan which bordreth vpon the wyldernesse.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 7, 'And then turned they and came to the well of iugmente which is Cades and smote all the contre of the Amalechites and also the amorytes that dwell in Hazezon Thamar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 8, 'Than went out the kynge of Sodome and the kynge of Gomorra and the kinge of Adama and the kynge of Zeboijm and the kynge of Bela now called Zoar. And sette their men in aray to fyghte wyth them in the vale of siddim that is to say');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 9, 'wyth kedorlaomer the kynge of Elam and with Thydeall kynge of the Nations and wyth Amraphel kynge of Synear. And with Arioch kynge of Ellasar: foure kynges agenste v.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 10, 'And that vale of siddim was full of slyme pyttes.And the kynges of Sodome and Gomorra fled and fell there. And the resydue fled to the mountaynes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 11, 'And they toke all the goodes of Sodome and Gomorra and all their vitalles ad went their waye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 12, 'And they toke Lot also Abrams brothers sonne and his good (for he dwelled at Sodome) and departed:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 13, 'Than came one that had escaped and tolde Abram the hebrue which dwelled in the okegrove of Mamre the Amoryte brother of Eschol and Aner: which were confederate wyth Abram.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 14, 'When Abram herde that his brother was taken he harnessed his seruantes borne in his owne house .iij. hundred and .xviij. ad folowed tyll they came at Dan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 15, 'And sette hymselfe ad his seruantes in aray and fell vpon them by nyght and smote them and chased them awaye vnto Hoba: which lyeth on the lefte hande of Damascos');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 16, 'and broughte agayne all the goodes and also his brother Lot ad his goodes the weme also and the people.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 17, 'And as he retourned agayne from the slaughter of kedorlaomer and of the kynges that were with hym than came the kynge of Sodome agaynst hym vnto the vale of Saue which now is called kynges dale.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 18, 'Than Melchisedech kinge of Salem brought forth breed and wyne. And he beynge the prest of the most hyghest God');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 19, 'blessed hym saynge. Blessed be Abram vnto the most hyghest God possessor of heauen and erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 20, 'And blessed be God the most hyghest which hath delyvered thyne enimies in to thy handes. And Abra gaue hym tythes of all.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 21, 'Than sayd the kynge of Sodome vnto Abram: gyue me the soulles and take the goodes to thy selfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 22, 'And Abram answered the kynge of Sodome: I lyfte vpp my hande vnto the LORde God most hygh possessor of heaven ad erth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 23, 'that I will not take of all yt is thyne so moch as a thred or a shoulacher lest thou shuldest saye I haue made Abra ryche.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 14, 24, 'Saue only that which the yonge men haue eaten ad the partes of the men which went wyth me. Aner Escholl and Mamre. Let them take their partes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 1, 'After these deades ye worde of God came vnto Abram in a vision saynge feare not Abram I am thy shilde and thy rewarde shalbe exceadynge greate.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 2, 'And Abram answered: LORde Iehouah what wilt thou geue me: I goo childlesse and the cater of myne housse this Eleasar of Damasco hath a sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 3, 'And Abram sayd: se to me hast thou geven no seed: lo a lad borne in my housse shalbe myne heyre.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 4, 'And beholde the worde of the LORde spake vnto Abram sayenge: He shall not be thyne heyre but one that shall come out of thyne awne bodye shalbe thyne heyre.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 5, 'And he brought him out at the doores ad sayde. Loke vpp vnto heaven and tell the starres yf thou be able to nobre them. And sayde vnto him Even so shall thy seed be.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 6, 'And Abram beleved the LORde and it was counted to him for rightwesnes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 7, 'And he sayde vnto hym: I am the LORde that brought the out of Vrin Chaldea to geue the this lande to possesse it.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 8, 'And he sayde: LORde God whereby shall I knowe that I shall possesse it?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 9, 'And he sayde vnto him: take an heyfer of .iij. yere olde and a she gotte of thre yeres olde and a thre yere olde ram a turtill doue and a yonge pigeon.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 10, 'And he toke all these and devyded them in the myddes and layde euery pece one over agenst a nother. But the foules devyded he not.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 11, 'And the byrdes fell on the carcases but Abra droue the awaye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 12, 'And when the sonne was doune there fell a slomber apon Abram. And loo feare and greate darknesse came apon hym.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 13, 'And he sayde vnto Abram: knowe this of a suertie that thi seed shalbe a straunger in a lande that perteyneth not vnto the. And they shall make bondmen of them and entreate them evell iiij. hundred yeares.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 14, 'But the nation whom they shall serue wyll I iudge. And after warde shall they come out wyth greate substace.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 15, 'Neuerthelesse thou shalt goo vnto thi fathers in peace ad shalt be buried when thou art of a good age:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 16, 'ad in the fourth generation they shall come hyther agayne for the wekednesse of the Amorites ys not yet full.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 17, 'When the sonne was doune and it was waxed darke: beholde there was a smokynge furnesse and a fyre brand that went betwene the sayde peces.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 18, 'And that same daye the LORde made a covenaunte with Abram saynge: vnto thy seed wyll I geue thys londe fro the ryver of Egypte even vnto the greate ryver euphrates:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 19, 'the kenytes the kenizites the Cadmonites');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 20, 'the Hethites the Pherezites the Raphaims');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 15, 21, 'the Amorytes the Canaanites the Gergesites and the Iebusites.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 1, 'Sarai Abrams wyfe bare him no childerne. But she had an hand mayde an Egiptian whose name was Hagar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 2, 'Wherfore the sayde vnto Abram. Beholde the LORde hath closed me that I can not bere. I praye the goo in vnto my mayde peradueture I shall be multiplyed by meanes of her And Abram herde the voyce of Sarai. Than Sarai');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 3, 'Abrams wife toke Hagar hyr mayde the Egitian (after Abram had dwelled .x. yere in the lande of Canaan) and gaue her to hyr husbonde Abram to be his wyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 4, 'And he wente in vnto Hagar and she conceaved. And when she sawe that she had conceyved hyr mastresse was despised in hyr syghte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 5, 'Than sayd Sarai vnto Abram: Thou dost me vnrighte for I haue geuen my mayde in to thy bosome: and now because she seyth that she hath coceaved I am despysed in hyr syghte: the LORde iudge betwene the and me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 6, 'Than sayde Abra to Sarai: beholde thy mayde is in thy hande do with hyr as it pleaseth the.And because Sarai fared foule with her she fled from her.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 7, 'And the angell of the LORde founde her besyde a fountayne of water in the wyldernes: euen by a well in the way to Sur.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 8, 'And he sayde: Hagar Sarais mayde whence comest thou and whether wylt thou goo ? And she answered: I flee from my mastresse Sarai.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 9, 'And the angell of the LORde sayde vnto her: returne to thy mastresse agayne and submytte thy selfe vnder her handes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 10, 'And the angell of ye LORde sayde vnto her: I will so encrease thy seed that it shall not be numbred for multitude.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 11, 'And the LORdes angell sayd further vnto her: se thou art wyth childe and shalt bere a sonne and shalt call his name Ismael: because the LORDE hath herde thy tribulation.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 12, 'He will be a wylde man and his hande will be agenst every man and euery mans hande agenst him. And yet shall he dwell faste by all his brothren.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 13, 'And she called the name of the LORde that spake vnto her: thou art the God that lokest on me for she sayde: I haue of a suertie sene here the backe parties of him that seith me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 14, 'Wherfore she called the well the well of the lyuynge that seith me which well is betwene Cades and Bared.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 15, 'And Hagar bare Abram a sonne and Abram called his sons name which Hagar bare Ismaell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 16, 16, 'And Abram was .lxxxvi. yere olde when Hagar bare him Ismael.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 1, 'When Abram was nynetye yere olde and ix. the LORde apeared to hym sayenge: I am the almyghtie God: walke before me ad be vncorrupte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 2, 'And I wyll make my bonde betwene the and me and wyll multiplye the excedyngly.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 3, 'And Abra fell on his face. And God talked moreover with hym saynge:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 4, 'I am beholde my testamet is with the that thou shalt be a father of many natios.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 5, 'Therfore shalt thou no more be called Abram but thy name shalbe Abraham: for a father of many nations haue I made the');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 6, 'and I will multiplye the excedyngly and wyll make nations of the: yee and kynges shall sprynge out of the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 7, 'Moreover I will make my bonde betwene me and the and thy seed after the in their tymes to be an everlastynge testament So that I wyll be God vnto the and to thy seed after the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 8, 'And I will geue vnto the ad to thy seed after the the lande where in thou arte a straunger: Euen all the lande of Canaan for an everlastynge possession and wil be their God.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 9, 'And God sayde vnto Abraha: Se thou kepe my testamente both thou and thy seed after the in their tymes:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 10, 'This is my testamente which ye shall kepe betwene me and you and thy seed after the that ye circucyse all youre men childern ye shall circumcyse');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 11, 'the foreskynne of youre flesh ad it shal be a token of the bond betwixte me and you.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 12, 'And euery manchilde when it is viij. dayes olde shal be circucysed amonge you in youre generations and all servauntes also borne at home or boughte with money though they be straungers and not of thy seed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 13, 'The seruaunte borne in thy housse ad he also that is bought with money must needes be circumcysed that my testament may be in youre flesh for an everlastinge bonde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 14, 'Yf there be any vncircuncysed manchilde that hath not the forskynne of his flesh cutt of his soule shall perish from his people: because he hath broke my testamet');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 15, 'And God sayde vnto Abraham. Sarai thy wyfe shall nomore be called Sarai: but Sara shall hir name be.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 16, 'For I will blesse her and geue the a sonne of her and will blesse her: so that people ye and kynges of people shall springe of her.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 17, 'And Abraham fell vpon his face ad laughte and sayd in his harte: shall a childe be borne vnto hym that is an hundred yere olde ad shall Sara that is nynetie yere olde bere?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 18, 'And Abraha sayde vnto God. O that Ismaell myghte lyve in thy syghte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 19, 'The sayde God: na Sara thy wife shall bere the a sonne ad thou shalt call his name Isaac. And I will make my bonde with him that it shall be an everlastynge bonde vnto his seed after him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 20, 'And as concernynge Ismaell also I haue herde thy request: loo I will blesse him and encrease him and multiplye him excedyingly. Twelve prynces shall be begete and I will make a great nation of him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 21, 'But my bonde will I make with Isaac which Sara shall bere vnto the: even this tyme twelue moneth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 22, 'And God left of talkynge with him and departed vp from Abraham.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 23, 'And Abraham toke Ismaell his sonne and all the servauntes borne in his housse and all that was bought with money as many as were menchildren amonge the me of Abrahas housse and circumcysed the foreskynne of their flesh even the selfe same daye as God had sayde vnto him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 24, 'Abraham was nynetie yere olde and .ix. when he cutt of the foreskynne of his flesh.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 25, 'And Ismaell his sonne was .xiij. yere olde when the foreskynne of hys flesh was circumcysed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 26, 'The selfe same daye was Abraha circucised and Ismael his sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 17, 27, 'And all the men in his housse whether they were borne in his housse or bought wyth money (though they were straungers) were circumcysed with him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 1, 'And the LORde apeared vnto him in the okegrove of Mamre as he sat in his tent doze in the heate of the daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 2, 'And he lyfte vp his eyes and looked: ad lo thre men stode not farr from hym. And whe he sawe them he ran agenst them from the tent dore and fell to the grounde');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 3, 'and sayde: LORde yf I haue founde fauoure in thy syght goo not by thi seruaunte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 4, 'Let a litle water be fett and wash youre fete and rest youre selves vnder the tree:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 5, 'And I will fett a morsell of breed to comforte youre hartes wythall. And tha goo youre wayes for even therfore ar ye come to youre servaunte. And they answered: Do even so as thou hast sayde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 6, 'And Abraha went a pace in to his tent vnto Sara ad sayde: make redy att once thre peckes of fyne meale kneade it and make cakes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 7, 'And Abraham ran vnto his beastes and fett a calfe that was tendre and good and gaue it vnto a yonge man which made it redy attonce.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 8, 'And he toke butter and mylcke and the calfe which he had prepared and sett it before them and stode hymselfe by them vnder the tree: and they ate.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 9, 'And they sayde vnto him: Where is Sara thy wife? And he sayde: in the tent.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 10, 'And he sayde: I will come agayne vnto the as soone as the frute can lyue. And loo: Sara thy wife shall haue a sonne. That herde Sara out of the tent doore which was behind his backe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 11, 'Abraham and Sara were both olde and well stryken in age and it ceased to be with Sara after the maner as it is wyth wyves.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 12, 'And Sara laughed in hir selfe saynge: Now I am waxed olde shall I geue my selfe to lust and my lorde olde also?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 13, 'Than sayd the LORde vnto Abraha: wherfore doth Sara laughe saynge: shal I of a suertie bere a childe now when I am olde?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 14, 'is the thinge to harde for the LORde to do? In the tyme appoynted will I returne vnto the as soone as the frute can haue lyfe And Sara shall haue a sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 15, 'Than Sara denyed it saynge: I laughed not for she was afrayde. But he sayde: yes thou laughtest.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 16, 'Than the men stode vp from thence ad loked towarde Sodome. And Abraham went with them to brynge them on the waye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 17, 'And the LORde sayde: Can I hyde from Abraham that thinge which I am aboute to do');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 18, 'seynge that Abraham shall be a great ad a myghtie people and all the nations of the erth shalbe blessed in him?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 19, 'For I knowe him that he will commaunde his childern and his housholde after him yt they kepe the waye of the LORde to do after righte and conscyence that the LORde may brynge vppon Abraham that he hath promysed him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 20, 'And the LORde sayde? The crie of Sodome and Gomorra is great and there synne is excedynge grevous.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 21, 'I will go downe and see whether they haue done all to gedder acordynge to that crye which is come vnto me or not that I may knowe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 22, 'And the me departed thece and went to Sodomeward. But Abraham stode yet before ye LORde');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 23, 'and drewe nere and saydeWylt thou destroy the rightwes with the wyked?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 24, 'Yf there be .l. rightwes within the cyte wilt thou destroy it and not spare the place for the sake of .l. rightwes that are therin?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 25, 'That be farre from the that thou shuldest do after thys maner to sley the rightwes with the weked ad that the rightwes shulde be as the weked: that befarre from the. Shulde not the iudge of all ye worlde do acordynge to righte?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 26, 'And the LORde sayde: Yf I fynde in Sodome .l. rightwes within the cyte I will spare all the place for their sakes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 27, 'And Abraham answered and sayde: beholde I haue taken vppon me to speake vnto ye LORde ad yet am but dust ad asshes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 28, 'What though there lacke .v. of .l. rightwes wylt thou destroy all the cyte for lacke of .v? And he sayde: Yf I fynde there .xl. and .v. I will not destroy them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 29, 'And he spake vnto him yet agayne and sayde: what yf there be .xl. foude there: And he sayde: I wyll not do it for forties sake.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 30, 'And he sayde: O let not my LORde be angrye that I speake. What yf there be foude .xxx. there? And he sayde: I will not do it yf I finde .xxx. there.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 31, 'And be sayde: Oh se I haue begonne to speake vnto my LORde what yf there be .xx. founde there? And he sayde: I will not distroy the for tweties sake.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 32, 'And he sayde: O let not my LORde be angrye that I speake yet but eue once more only. What yf ten be founde there?. And he sayde: I will not destroy the for .x. sake.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 18, 33, 'And the LORde wet his waye as soone as he had lefte comenynge with Abraha. And Abraham returned vnto his place');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 1, 'And there came .ij. angells to Sodome at euen. And Lot satt at the gate of the cyte. And Lot sawe the and rose vp agaynst them and he bowed hym selfe to he grounde with his face.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 2, 'And he sayde: Se lordes turne in I praye you in to youre servauntes house and tary all nyghte and wash youre fete and ryse vp early and go on youre wayes. And they sayde: nay but we will byde in the streates all nyghte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 3, 'And he copelled them excedyngly. And they turned in vnto hym and entred in to his house and he made them a feaste and dyd bake swete cakes and they ate.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 4, 'But before they went to rest the men of the cyte of Sodome compassed the house rownde aboute both olde and yonge all the people from all quarters.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 5, 'And they called vnto Lot and sayde vnto him: where are the men which came in to thy house to nyghte? brynge the out unto vs that we may do oure lust with them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 6, 'And Lot went out at doores vnto them and shote the dore after him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 7, 'and sayde: nay for goddes sake brethren do not so wekedly.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 8, 'Beholde I haue two doughters which haue knowne no man the will I brynge out vnto you: do with them as it semeth you good: Only vnto these men do nothynge for therfore came they vnder the shadowe of my rofe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 9, 'And they sayde: come hither. And they sayde: camest thou not in to sogeorne and wilt thou be now a iudge? we will suerly deale worse with the than with themAnd as they preased fore vppon Lot and beganne to breake vp the doore');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 10, 'the men put forth their handes and pulled Lot in to the house to them and shott to the doore.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 11, 'And the men that were at the doore of the house they smote with blyndnesse both small and greate: so that they coude not fynde the doore.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 12, 'And the men sayde moreover vnto Lot: Yf thou have yet here any sonne in lawe or sonnes or doughters or what so euer thou hast in the cyte brynge it out of this place:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 13, 'for we must destroy this place because the crye of the is great before the LORde. Wherfore he hath sent vs to destroy it.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 14, 'And Lot went out and spake vnto his sonnes in lawe which shulde haue maried his doughters and sayde: stonde vpp and get yow out of this place for the LORde will destroy the cite. But he semed as though he had mocked vnto his sonnes in law.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 15, 'And as the mornynge arose the angells caused Lot to spede him saynge. Stonde vp take thy wyfe and thy two doughters and that that is at hande lest thou perish in the synne of the cyte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 16, 'And as he prolonged the tyme the men caught both him his wife ad his two doughters by the handes because the LORde was mercyfull vnto him ad they brought him forth and sette him without the cyte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 17, 'When they had brought them out they sayde: Saue thy lyfe and loke not behynde the nether tary thou in any place of the contre but saue thy selfe in the mountayne lest thou perisshe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 18, 'Than sayde Lot vnto them: Oh nay my lorde:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 19, 'beholde in as moch as thy servaunte hath fownde grace in thy syghte now make thi mercy great which thou shewest vnto me in savinge my lyfe. For I can not saue my selfe in the mountayns lest some misfortune fall vpon me and I dye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 20, 'Beholde here is a cyte by to flee vnto and it is a lytle one: let me saue my selfe therein: is it not a litle one that my soule may lyue?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 21, 'And he sayde to him: se I haue receaved thy request as concernynge this thynge that I will nott overthrowe this cytie for the which thou hast spoken.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 22, 'Haste the ad saue thy selfe there for I can do nothynge tyll thou be come in thyder. And therfore the name of the cyte is called Zoar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 23, 'And the sone was vppon the erth when Lot was entred in to Zoar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 24, 'Than the LORde rayned vpon Sodome and Gomorra brymstone and fyre from the LORde out of heaven');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 25, 'and overthrewe those cyteis and all the region and all that dwelled in the cytes and that that grewe vpon the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 26, 'And lots wyfe loked behynde her ad was turned in to a pillare of salte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 27, 'Abraham rose vp early and got him to the place where he stode before the LORde');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 28, 'and loked toward Sodome and Gomorra and toward all the londe of that contre. And as he loked: beholde the smoke of the contre arose as it had bene the smoke of a fornace.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 29, 'But yet whe God destroyed the cities of ye regio he thought a pon Abraha: and sent Lot out from the dager of the overthrowenge when he overthrewe the cyttes where Lot dwelled.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 30, 'And Lot departed out of Zoar and dwelled in the mountayns ad his .ij. doughters with him for he feared to tary in Zoar: he dweld therfore in a caue both he and his .ij. doughters also.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 31, 'Than sayde the elder vnto the yonger oure father is olde and there are no moo men in the erth to come in vnto vs after the maner of all the world.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 32, 'Come therfore let vs geue oure father wyne to dryncke and let vs lye with him that we may saue seed of oure father.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 33, 'And they gaue their father wyne to drynke that same nyghte. And the elder doughter went and laye with her father. And he perceaued it not nether when she laye doune nether when she rose vp.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 34, 'And on the morowe the elder sayde vnto the yonger: beholde yesternyghte laye I with my father. Let us geue hym wyne to drinke this nyghte also and goo thou and lye with him and let us saue seed of oure father.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 35, 'And they gaue their father wyne to drincke that nyghte also. And the yonger arose and laye with him. And he perceaved it not: nether when she laye downe nether when she rose vp.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 36, 'Thus were both the doughters of lot with childe by their father');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 37, 'And the elder bare a sone and called hym Moab which is the father of the Moabytes vnto this daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 19, 38, 'And the yonger bare a sonne and called hym Ben Ammi which is the father of the childern of Ammon vnto this daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 1, 'And Abraham departed thence towarde the southcontre and dwelled betwene Cades and Sur ad sogeorned in Gerar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 2, 'And Abraham sayde of Sara his wyfe that she was his sister. Than Abimelech kynge of Gerar sent and fett Sara awaye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 3, 'And God came to Abimelech by nyghte in a dreame and sayde to him: Se thou art but a deed man for the womas sake which thou hast taken awaye for she is a mans wyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 4, 'But Abimelech had not yet come nye her and therfore sayde: lorde wilt thou sley rightewes people?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 5, 'sayde not he vnto me that she was hys sister? yee and sayde not she herself that he was hir brother? wyth a pure herte and innocent handes haue I done this.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 6, 'And God sayde vnto him in a dreame. I wot it well that thou dydest it in the purenesse of thi herte. And therfore I kepte ye that thou shuldest not synne agenst me nether suffred I the to come nygh her.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 7, 'Now therfore delyuer the ma his wyfe ageyne for he is a prophete. And let him praye for the that thou mayst lyue. But and yf thou delyuer her not agayne be sure that thou shalt dye the deth with all that thou hast.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 8, 'Than Abimelech rose vp be tymes in the mornynge and called all his servauntes and tolde all these thinges in their eares and the men were sore a frayde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 9, 'And Abimelech called Abraham and sayde vnto him: What hast thou done vnto vs and what haue I offended the that thou shuldest brynge on me and on my kyngdome so greate a synne? thou hast done dedes vnto me that ought not to be done.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 10, 'And Abimelech sayde morouer vnto Abraham: What sawest thou that moved the to do this thinge?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 11, 'And Abraham Answered. I thought that peradveture the feare of God was not in this place and that they shulde sley me for my wyfes sake:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 12, 'yet in very dede she is my sister the doughter of my father but not of my mother: and became my wyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 13, 'And after God caused me to wandre out of my fathers house I sayde vnto her: This kyndnesse shalt thou shewe vnto me in all places where we come that thou saye of me how that I am thy brother.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 14, 'Than toke Abimelech shepe and oxen menservauntes and wemenseruauntes and gaue them vnto Abraham and delyvered him Sara his wyfe agayne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 15, 'And Abimelech sayde: beholde the lande lyeth be fore the dwell where it pleaseth ye best.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 16, 'And vnto Sara he sayde: Se I haue geuen thy brother a thousande peeces of syluer beholde he shall be a couerynge to thyne eyes vnto all that ar with the and vnto all men and an excuse.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 17, 'And so Abraham prayde vnto God and God healed Abimeleh and his wyfe and hys maydens so that they bare.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 20, 18, 'For the LORde had closed to all the matryces of the house of Abimelech because of Sara Abrahams wyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 1, 'The lorde visyted Sara as he had sayde and dyd vnto her acordynge as he had spoken.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 2, 'And Sara was with childe and bare Abraha a sonne in his olde age euen the same season which the LORde had appoynted.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 3, 'And Abraham called his sonnes name that was borne vnto him which Sara bare him Isaac:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 4, 'and Abra circucysed Isaac his sone whe he was .viij. dayes olde as God commaunded him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 5, 'And Abraha was an hundred yere olde when his sonne Isaac was borne vnto him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 6, 'And Sara sayde: God hath made me a laughinge stocke: for all yt heare will laugh at me');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 7, 'She sayde also: who wolde haue sayde vnto Abraham that Sara shulde haue geuen childern sucke or yt I shulde haue borne him a sonne in his olde age:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 8, 'The childe grewe and was wened and Abraham made a great feast the same daye that Isaac was wened.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 9, 'Sara sawe the sonne of Hagar the Egiptian which she had borne vnto Abraham a mockynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 10, 'Then she sayde vnto Abraham: put awaye this bondemayde and hyr sonne: for the sonne of this bondwoman shall not be heyre with my sonne Isaac:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 11, 'But the wordes semed verey greavous in Abrahams syghte because of his sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 12, 'Than the LORde sayde vnto Abraham: let it not be greavous vnto the because of the ladd and of thy bondmayde: But in all that Sara hath saide vnto the heare hir voyce for in Isaac shall thy seed be called.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 13, 'Moreouer of the sonne of the Bondwoman will I make a nation because he is thy seed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 14, 'And Abraham rose vp early in the mornyng and toke brede and a bottell with water and gaue it vnto Hagar puttynge it on hir shulders wyth the lad also and sent her awaye. And she departed and wadred vpp and doune in the wyldernes of Berseba.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 15, 'When the water was spent that was in the botell she cast the lad vnder a bush');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 16, 'and went and satt her out of syghte a great waye as it were a bowshote off: For she sayde: I will not se the lad dye. And she satt doune out of syghte and lyfte vp hyr voyce and wepte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 17, 'And God herde the voyce of the childe. And the angell of God called Hagar out of heaven and sayde vnto her: What ayleth the Hagar? Feare not for God hath herde the voyce of the childe where he lyeth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 18, 'Aryse and lyfte vp the lad and take hym in thy hande for I will make off him a greate people.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 19, 'And God opened hir eyes and she sawe a well of water. And she went and fylled the bottell with water and gaue the boye drynke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 20, 'And God was wyth the lad and he grewe and dweld in the wildernesse and became an archer.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 21, 'And he dweld in the wyldernesse of Pharan. And hys mother gott him a wyfe out of the land of Egypte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 22, 'And it chaunced the same season that Abimelech and Phicoll his chefe captayne spake vnto Abraham saynge: God is wyth the in all that thou doist.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 23, 'Now therfore swere vnto me even here by God that thou wylt not hurt me nor my childern nor my childerns childern. But that thou shalt deale with me and the contre where thou art a straunger acordynge vnto the kyndnesse that I haue shewed the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 24, 'Then sayde Abraham: I wyll swere.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 25, 'And Abraham rebuked Abimelech for a well of water which Abimelech servauntes had taken awaye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 26, 'And Abimelech answered I wyst not who dyd it: Also thou toldest me not nether herde I of it but this daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 27, 'And Abraham toke shepe and oxen and gaue them vnto Abimelech. And they made both of them a bonde together.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 28, 'And Abraham sett vij. lambes by them selues.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 29, 'And Abimelech sayde vnto Abraham: what meane these .vij. lamdes which thou hast sett by them selues.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 30, 'And he answered: vij. lambes shalt thou take of my hande that it maye be a wytnesse vnto me that I haue dygged this well:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 31, 'Wherfore the place is called Berseba because they sware both of them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 32, 'Thus made they a bonde to gether at Berseba.Than Abimelech and Phicoll his chefe captayne rose vp and turned agayne vnto the lande of the Philistines.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 33, 'And Abraham planted a wodd in Berseba and called there on the name of the LORde the everlastynge God:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 21, 34, 'and dwelt in the Phelistinlade alonge season');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 1, 'After these dedes God dyd proue Abraham and sayde vnto him: Abraham. And he answered: here am I.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 2, 'And he sayde: take thy only sonne Isaac whome thou louest and get the vnto the lande of Moria and sacrifyce him there for a sacrifyce vpon one of the mountayns which I will shewe the');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 3, 'Than Abraham rose vp early in the mornynge and sadled his asse and toke two of his meyny wyth him and Isaac his sonne: ad clove wod for the sacrifyce and rose vp and gott him to the place which God had appoynted him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 4, 'The thirde daye Abraham lyfte vp his eyes and sawe the place a farr of');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 5, 'and sayde vnto his yong men: byde here with the asse. I and the lad will goo yonder and worshippe and come agayne vnto you.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 6, 'And Abraham toke the wodd of the sacrifyce and layde it vpon Isaac his sonne and toke fyre in his hande and a knyfe. And they went both of them together.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 7, 'Than spake Isaac vnto Abraham his father and sayde: My father? And he answered here am I my sonne. And he sayde: Se here is fyre and wodd but where is the shepe for sacrifyce?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 8, 'And Abraham sayde: my sonne God wyll prouyde him a shepe for sacrifyce. So went they both together.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 9, 'And when they came vnto the place which God shewed him Abraha made an aulter there and dressed the wodd ad bownde Isaac his sonne and layde him on the aulter aboue apon the wodd.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 10, 'And Abraham stretched forth his hande and toke the knyfe to haue kylled his sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 11, 'Than the angell of the LORde called vnto him from heauen saynge: Abraham Abraham. And he answered: here am I.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 12, 'And he sayde: laye not thy handes apon the childe nether do any thinge at all vnto him for now I knowe that thou fearest God in yt thou hast not kepte thine only sonne fro me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 13, 'And Abraham lyfted vp his eyes and loked aboute: and beholde there was a ram caught by the hornes in a thykette. And he went and toke the ram and offred him vp for a sacrifyce in the steade of his sonne');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 14, 'And Abraham called the name of the place the LORde will see: wherfore it is a come saynge this daye: in the mounte will the LORde be sene.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 15, 'And the Angell of the LORde cryed vnto Abraham from heaven the seconde tyme');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 16, 'saynge: by my selfe haue I sworne (sayth the LORde) because thou hast done this thinge and hast not spared thy only sonne');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 17, 'that I will blesse th and multiplye thy seed as the starres of heaven and as the sonde vpo the seesyde. And thy seed shall possesse the gates of hys enymies.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 18, 'And in thy seed shall all the nations of the earth be blessed because thou hast obeyed my voyce.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 19, 'So turned Abraham agayne vnto his yonge men and they rose vp and wet to gether to Berseba. And Abraham dwelt at Berseba');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 20, 'And it chaused after these thiges that one tolde Abraham saynge: Beholde Milcha she hath also borne childern vnto thy brother Nachor:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 21, 'Hus his eldest sonne and Bus his brother and Lemuell the father of the Sinans');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 22, 'and Cesed and Haso and Pildas and Iedlaph and Bethuel.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 23, 'And Bethuel begat Rebecca. These .viij. dyd Milcha bere to Nachor Abrahams brother');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 22, 24, 'And his concubyne called Rheuma she bare also Tebah Gaham Thahas and Maacha.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 1, 'Sara was an hundred and .xxvij. yere olde (for so longe lyued she)');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 2, 'and than dyed in a heade cyte called Hebron in the londe of Canaan. Than Abraham came to morne Sara and to wepe for her.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 3, 'And Abraham stode vp from the coorse and talked with the sonnes of heth saynge:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 4, 'I am a straunger ad a foryner amonge yow geue me a possession to bury in with you that I may bury my dead oute of my sighte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 5, 'And the children of heth answered Abraham saynge vnto him:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 6, 'heare vs lorde thou art a prynce of God amonge vs. In the chefest of oure sepulchres bury thy dead: None of vs shall forbydd ye his sepulchre yt thou shuldest not bury thy deade therein.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 7, 'Abraha stode vp and bowed hi selfe before ye people of ye lade ye childre of heth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 8, 'And he comoned with them saynge: Yf it be youre myndes yt I shall bury my deade oute of my sighte heare me ad speke for me to Ephron the sonne of Zoar:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 9, 'and let him geue me the dubill caue which he hath in the end of his felde for as moch money as it is worth let him geue it me in the presence of you for a possession to bury in.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 10, 'For Hephron dwelled amoge ye childern of heth.Than Ephron the Hethite answered Abraham in the audyece of the childern of Heth and of all that went in at the gates of his cyte saynge:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 11, 'Not so my lorde but heare me: The felde geue I the and the caue that therein is geue I the also And even in the presence of the sonnes of my people geve I it the to bury thy deede in.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 12, 'Than Abraham bowed himselfe before the people of the lade');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 13, 'and spake vnto Ephro in the audyence of the people of the contre saynge: I praye the heare me I will geue sylver for the felde take it of me ad so will I bury my deed there.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 14, 'Ephron answered Abraha saynge vnto him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 15, 'My lorde harken vnto me. The lande is worth iiij. hundreth sycles of syluer: But what is that betwixte the and me? bury thy deede.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 16, 'And Abraham harkened vnto Ephron and weyde him the sylver which he had sayde in the audyence of the sonnes of Heth. Euen .iiij. hudred syluer sycles of currant money amonge marchauntes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 17, 'Thus was the felde of Ephron where in the dubbill caue is before Mamre: euen the felde and the caue that is therein and all the trees of the felde which growe in all the borders rounde aboute made sure');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 18, 'vnto Abraham for a possession in the syghte of the childern of Heth and of all that went in at the gates of the cyte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 19, 'And then Abraham buried Sara his wyfe in the double caue of the felde that lyeth before Mare otherwise called Ebron in the lande of Canaan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 23, 20, 'And so both the felde ad the caue that is therein was made vnto Abraham a sure possession to bury in of the sonnes of Heth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 1, 'Abraham was olde and stryken in dayes and the LORde had blessed him in all thinges.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 2, 'And he sayde vnto his eldest servaunte of his house which had the rule over all that he had: Put thy hande vnder my thye that');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 3, 'I maye make the swere by the LORde that is God of heauen and God of the erth that thou shalt not take a wyfe vnto my sonne of the doughters of the canaanytes amonge which I dwell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 4, 'But shalt goo vnto my contre and to my kynred and there take a wyfe vnto my sonne Isaac.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 5, 'Tha sayde the seruaunte vnto him: what ad yf the woma wyll not agree to come with me vnto this lade shall I brynge thy sonne agayne vnto the lande which thou camest out of:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 6, 'And Abraha sayde vnto him: bewarre of that that thou brige not my sonne thither.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 7, 'The LORde God of heauen which toke me from my fathers house and from the lande where I was borne and which spake vnto me and sware vnto me saynge: vnto thy seed wyll I geue this lande he shall sende his angell before the yt thou mayst take a wife vnto my sonne from thence.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 8, 'Neuerthelesse yf the woma will not agree to come with the than shalt thou be with out daunger of this ooth. But aboue all thinge brynge not my sonne thyther agayne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 9, 'And the seruaunte put his hand vnder the thye of Abraham and sware to him as concernynge that matter.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 10, 'And the seruaunte toke .x. camels of the camels of his master and departed and had of all maner goodes of his master with him and stode vp and went to Mesopotamia vnto the cytie of Nahor.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 11, 'And made his camels to lye doune with out the cytie by a wels syde of water at euen: aboute the tyme that women come out to drawe water');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 12, 'and he sayde.LORde God of my master Abraha sende me good spede this daye and shewe mercy vnto my master Abraham.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 13, 'Lo I stonde here by the well of water and the doughters of the men of this citie will come out to drawe water:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 14, 'Now the damsell to whome I saye stoupe doune thy pytcher and let me drynke. Yf she saye drynke and I will geue thy camels drynke also yt same is she that thou hast ordened for they servaunte Isaac: yee and therby shall I knowe that thou hast shewed mercy on my master.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 15, 'And it came to passe yer he had leeft spakynge that Rebecca came out the doughter of Bethuell sonne to Melcha the wife of Nahor Abrahams brother and hir pytcher apon hir shulder:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 16, 'The damsell was very fayre to loke apon and yet a mayde and vnknowen of man.And she went doune to the well and fylled hyr pytcher and came vp agayne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 17, 'Then the seruaunte ranne vnto her and sayde: let me syppe a litle water of thi pither.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 18, 'And she sayde: drynke my lorde.And she hasted and late downe her pytcher apon hyr arme and gaue him drinke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 19, 'And whe she had geven hym drynke she sayde: I will drawe water for thy camels also vntill they haue dronke ynough.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 20, 'And she poured out hyr pitcher in to the trough hastely and ranne agayne vnto the well to fett water: and drewe for all his camels.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 21, 'And the felowe wondred at her. But helde his peace to wete whether the LORde had made his iourney prosperous or not.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 22, 'And as the camels had lefte drynckynge he toke an earynge of halfe a sicle weght and .ij golden bracelettes for hyr hades of .x. sycles weyght of gold');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 23, 'and sayde vnto her: whose doughter art thou? tell me: ys there rowme in thy fathers house for vs to lodge in?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 24, 'And she sayde vnto him: I am the doughter of Bethuell the sonne of Milcha which she bare vnto Nahor:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 25, 'and sayde moreouer vnto him: we haue litter and prauonder ynough and also rowme to lodge in.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 26, 'And the man bowed himselfe and worshipped the LORde');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 27, 'and sayde: blessed be the LORde God of my master Abraham which ceasseth not to deale mercyfully and truly with my master And hath brought me the waye to my masters brothers house.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 28, 'And the damsell ranne and tolde them of her mothers house these thinges.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 29, 'And Rebecca had a brother called Laban.And Laban ranne out vnto the man to the well:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 30, 'for as soone as he had sene the earynges and the bracelettes apon his sisters handes ad herde the wordes of Rebecca his sister saynge thus sayde the man vnto me than he went out vnto the man. And loo he stode yet with the camels by the well syde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 31, 'And Laban sayde: come in thou blessed of the LORde. Wherfore stondest thou without? I haue dressed the house and made rowme for the camels.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 32, 'And than the ma came in to the house. And he vnbrydeld the camels: and brought litter and prauonder for the camels and water to weshe his fete and their fete that were with him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 33, 'and there was meate sett before him to eate.But he sayde: I will not eate vntill I haue sayde myne earede: And he sayde saye on.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 34, 'And he sayde: I am Abrahas servaunte');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 35, 'and the LORDE hath blessed my master out of measure that he is become greate and hath geven him shepe oxen syluer and golde menservauntes maydeservauntes camels ad asses.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 36, 'And Sara my masters wyfe bare him a sonne whe she was olde: and vnto him hath he geven all that he hath.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 37, 'And my master made me swere saynge: Thou shalt not take a wyfe to my sonne amonge the doughters of the cananytes in whose lade I dwell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 38, 'But thou shalt goo vnto my fathers house and to my kynred and there take a wyfe vnto my sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 39, 'And I sayde vnto my master. What yf the wyfe will not folowe me?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 40, 'And he sayde vnto me: The LORde before whome I walke wyll sende his angell with the and prosper thy iourney that thou shalt take a wyfe for my sonne of my kynred and of my fathers house.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 41, 'But and yf (when thou comest vnto my kynred) they will not geue the one tha shalt thou bere no perell of myne oothe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 42, 'And I came this daye vnto the well and sayed: O LORde the God of my master Abraha yf it be so that thou makest my iourney which I go prosperous:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 43, 'beholde I stode by this well of water And when a virgyn cometh forth to drawe water and I saye to her: geue me a litle water of thi pitcher to drynke');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 44, 'and she saye agayne to me: dryncke thou and I will also drawe water for thy camels: that same is the wife whom the LORde hath prepared for my masters sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 45, 'And before I had made an ende of speakynge in myne harte: beholde Rebecca came forth and hir pitcher on hir shulder and she went doune vnto the well and drewe. And I sayde vnto her geue me drynke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 46, 'And she made hast and toke doune hir pitcher from of hir ad sayd: drinke and I will geue thy camels drynke also. And I dranke and she gaue the camels drynke also.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 47, 'And I asked her saynge: whose doughter art thou? And she answered: the doughter of Bathuell Nahors sonne whome Milca bare vnto him.And I put the earynge vpon hir face and the bracelettes apon hir hondes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 48, 'And I bowed my selfe and worshepped the LORde and blessed the LORde God of my master Abraha which had brought me the right waye to take my masters brothers doughter vnto his sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 49, 'Now therfore yf ye will deall mercyfully and truly with my master tell me. And yf no tell me also: that I maye turne me to the right hande or to the left.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 50, 'Than answered Laban and Bathuel saynge: The thinge is proceded even out of the lorde we can not therfore saye vnto the ether good or bad:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 51, 'Beholde Rebecca before thy face take her and goo and let her be thy masters sonnes wife euen as the LORde hath sayde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 52, 'And whe Abrahams servaunte herde their wordes he bowed him selfe vnto the LORde flatt vpon the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 53, 'And the servaunte toke forth iewells of syluer and iewelles of gold and rayment and gaue them to Rebecca: But vnto hir brother and to hir mother he gaue spyces.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 54, 'And then they ate and dranke both he and the men that were with him and taried all nyghte and rose vp in the mornynge.And he sayde: let me departe vnto my master.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 55, 'But hir brother and hir mother sayde: let the damsell abyde with vs a while ad it be but even .x. dayes and than goo thy wayes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 56, 'And he sayde vnto them hinder me not: for the lorde hath prospered my iourney. Sende me awaye yt I maye goo vnto my master.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 57, 'And they sayde: let vs call the damsell and witt what she sayth to the matter.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 58, 'And they called forth Rebecca ad sayde vnto her: wilt thou goo with this ma? And she sayde: Yee.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 59, 'Than they broughte Rebecca their sister on the waye and her norse and Abrahas servaunte and the men that were wyth him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 60, 'And they blessed Rebecca and sayde vnto her: Thou art oure sister growe in to thousande thousandes and thy seed possesse ye gates of their emnies.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 61, 'And Rebecca arose and hir damsels and satt the vp apo the camels and went their waye after the man. And ye servaunte toke Rebecca and went his waye');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 62, 'And Isaac was a comige from the well of ye lyvynge and seynge for he dwelt in the south cotre');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 63, 'and was gone out to walke in his meditatios before ye eue tyde. And he lyfte vp his eyes and loked and beholde ye camels were cominge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 64, 'And Rebecca lyfte vp hir eyes and whe she sawe Isaac she lyghted of the camel');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 65, 'ad sayde vnto ye servaunte: what ma is this yt cometh agenst vs in the feld? And the servaute sayde: it is my master. And then she toke hir mantell ad put it aboute her.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 66, 'And the servaute tolde Isaac all that he had done.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 24, 67, 'The Isaac broughte her in to his mother Saras tente ad toke Rebecca and she became his wife and he loved her: and so was Isaac coforted over his mother.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 1, 'Abraha toke hi another wyfe cald Ketura');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 2, 'which bare hi Sunram Iacksam Medan Midia Iesback and Suah.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 3, 'And Iacksan begat Seba and Deda. And the sonnes of sedan were Assurim Letusim and Leumim.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 4, 'And the sonnes of Midian were Epha Epher Hanoch Abida and Elda. All these were the childern of Bethura.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 5, 'But Abraha gaue all that he had vnto Isaac.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 6, 'And vnto the sonnes of his concubines he haue giftes and sent them awaye from Isaac his sonne (while he yet lyved) east ward vnto the east contre.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 7, 'These are the dayes of the life of Abraha which he lyved: an hudred and .lxxv. yere');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 8, 'and than fell seke ad dyed in a lustie age (whe he had lyved ynough) ad was put vnto his people.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 9, 'And his sonnes Isaac ad Ismael buried hi in the duble caue in the feld of Ephro sone of Zoar the Hethite before Mamre.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 10, 'Which felde abraha boughte of the sonnes of Heth: There was Abraha buried and Sara hys wife.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 11, 'And after yt deeth of Abraha God blessed Isaac his sonne which dweld by the well of the lyvige and seige');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 12, 'These are the generatios of Ismael Abrahas sonne which Hagar the Egiptia Saras hand mayde bare vnto Abraham.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 13, 'And these are the names of the sones of Ismaell with their names in their kireddes. The eldest sone of Ismael Neuatoth the Redar Adbeel Mibsa');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 14, 'Misma Duma Masa');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 15, 'Hadar Thema Ietur Naphis and Redma.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 16, 'These are the sones of Ismael and these are their names in their townes and castels .xij. princes of natios.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 17, 'And these are the yeres of the lyfe of Ismael: an hudred and .xxxvij yere and than he fell seke and dyed and was layde vnto his people.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 18, 'And he dweld from Euila vnto Sur yt is before Egypte as men go toward the Assirias. And he dyed in the presence of all his brethren.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 19, 'And these are the generatios of Isaac Abrahas sonne: Abraha begat Isaac.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 20, 'And Isaac was .xl. yere olde whe he toke Rebecca to wyfe the doughter of Bethuel the Sirian of Mesopotamia and sister to Iaban the Sirien.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 21, 'And Isaac made intercessio vnto ye LORde for his wife: because she was bare: and ye LORde was itreated of hi and Rebecca his wife coceaued:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 22, 'and ye childern stroue together withi her, the she sayde: yf it shulde goo so to passe what helpeth it yt I am with childe? And she went and axed ye LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 23, 'And ye LORde sayde vnto her there are .ij. maner of people in the wombe and ij. nations shall springe out of thy bowels and the one nation shalbe myghtier than the other and the eldest shalbe servaunte vnto the yonger.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 24, 'And whe hir tyme was come to be delyuered beholde: there were .ij. twyns in hir wobe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 25, 'And he that came out first was redde and rough ouer all as it were an hyde: and they called his name Esau.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 26, 'And after ward his brother came out and his hande holdynge Esau by the hele. Wher fore his name was called Iacob. And Isaac was .lx. yere olde whe she bare the:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 27, 'and the boyes grewe and Esau became a conynge hunter and a tyllman. But Iacob was a simple man and dwelled in the tentes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 28, 'Isaac loved Esau because he dyd eate of his venyso but Rebecca loued Iacob');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 29, 'Iacob sod potage and Esau came from the feld and was faine');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 30, 'and sayd to Iacob: let me syppe of yt redde potage for I am fayntie. And therfore was his name called Edom.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 31, 'And Iacob sayde: sell me this daye thy byrthrighte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 32, 'And Esau answered: Loo I am at the poynte to dye and what profit shall this byrthrighte do me?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 33, 'And Iacob sayde swere to me then this daye. And he swore to him and sold his byrthrighte vnto Iacob.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 25, 34, 'Than Iacob gaue Esau brede and potage of redde ryse. And he ate and dronke and rose vp and went his waye. And so Esau regarded not his byrthrighte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 1, 'And there fell a derth in ye lande passinge the first derth yt fell in the dayes of Abraham. Wherfore Isaac went vnto Abimelech kinge of ye Philistias vnto Gerar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 2, 'The the LORde apeared vnto him and sayde goo not doune in to Egipte but byde in ye land which I saye vnto ye:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 3, 'Sogeorne in this lade and I wyll be with ye and wyll blesse ye: for vnto the and vnto thy sede I will geue all these cotreis And I will performe the oothe which I swore vnto Abraha thy father');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 4, 'and will multiplye thy seed as ye starres of heave and will geue vnto thy seed all these contreis. And thorow thy seed shall all the natios of the erth be blessed');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 5, 'because yt Abraha harkened vnto mi voyce and kepte mine ordinauces comaudmetes statutes and lawes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 6, 'And Isaac dwelled in Gerar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 7, 'And yt me of the place asked hi of his wife and he sayde yt she was his sister: for he feared to calle her his wife lest the me of the place shulde haue kylled hym for hir sake because she was bewtyfull to ye eye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 8, 'And it happened after he had bene there longe tyme yt Abimelech kinge of ye Philistias loked out at a wyndow and sawe Isaac sportinge with Rebecca his wife.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 9, 'And Abimelech sende for Isaac and sayde: se she is of a suertie thi wife and why saydest thou yt she was thi sister? And Isaac saide vnto hi: I thoughte yt I mighte peradventure haue dyed for hir sake.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 10, 'The fayde Abimelech: whi hast thou done this vnto vs? one of ye people myght lightely haue lyne by thy wife and so shuldest thou haue broughte synne vpon vs');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 11, 'Tha Abimelech charged all his people saynge: he yt toucheth this man or his wife shall surely dye for it.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 12, 'And Isaac sowed in yt lade and founde in ye same yere an hudred bushels: for ye LORde blessed hi');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 13, 'and the man waxed mightye and wet forth and grewe till he was exceadinge great');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 14, 'yt he had possessio of shepe of oxe and a myghtie housholde: so yt the Philestians had envy at him:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 15, 'In so moch yt they stopped and fylled vp with erth all the welles which his fathers servauntes dygged in his father Abrahams tyme.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 16, 'Than sayde Abimelech vnto Isaac: gett the fro me for thou art myhhtier then we a greate deale.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 17, 'Than Isaac departed thense and pitched his tente in the valey Gerar and dwelt there,');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 18, 'And Isaac digged agayne the welles of water which they dygged in the dayes of Abraha his father which the Philestias had stoppe after ye deth of Abraha and gaue the the same names which hys father gaue the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 19, 'As Isaacs seruautes dygged in the valey they founde a well of springynge water.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 20, 'And the herdme of Gerar dyd stryue with Isaacs herdme saynge: the water is oures Than called he the well Eseck because they stroue with hym.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 21, 'Than dygged they another well and they stroue for yt also. Therfore called he it Sitena.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 22, 'And than he departed these and dygged a nother well for the which they stroue not: therfore called he it Rehoboth saige: ye LORde hath now made vs rowme and we are encreased vpo the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 23, 'Afterward departed he thece and came to Berseba');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 24, 'And the LORde apered vnto hi the same nyghte and sayde. I am the God of Abraha thy father feare not for I am with the and will blesse the and multiplye thy sede for my seruaute Abrahams sake.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 25, 'And than he buylded an aulter there and called vpo the name of the LORde and there pitched his tente. And there Isaacs servauntes dygged a well.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 26, 'Than came Abimelech to him fro Gerar and Ahusath his frende and Phicol his chefe captayne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 27, 'And Isaac sayde vnto the: wherfore come ye to me seige ye hate me and haue put me awaye fro you?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 28, 'Than sayde they: we sawe that the LORde was with the and therfore we sayde that there shulde be an oothe betwixte vs ad the and that we wolde make a bonde with the:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 29, 'yt thou shuldeste do vs no hurte as we haue not touched the and haue done vnto the nothinge but good and sed the awaye in peace: for thou art now the blessed of the LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 30, 'And he made the a feast and they ate ad droke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 31, 'And they rose vp by tymes in the mornynge and sware one to another. And Isaac sent the awaye. And they departed from him in peace.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 32, 'And ye same daye came Isaacs servautes and tolde hi of a well which they had dygged: and sayde vnto hi that thei had founde water.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 33, 'And he called it Seba wherfore the name of the cyte is called Berseba vnto this daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 34, 'When Esau was .xl. yere olde he toke to wyfe Judith the doughter of Bely an Hethite and Busmath the doughter of Elon an Hethite');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 26, 35, 'also which were dishobedient vnto Isaac and Rebecca.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 1, 'And it came to passe that Isaac wexed olde and his eyes were dymme so that he coude nat see. Tha called he Esau his eldest sonne and sayde vnto him: mi sonne. And he sayde vnto hym: heare am I.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 2, 'And he sayde: beholde I am olde ad knowe not the daye of mi deth:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 3, 'Now therfore take thi weapes thy quiver and thi bowe and gett the to the feldes and take me some venyson');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 4, 'and make me meate such as I loue and brynge it me and let me eat that my soull may blesse the before that I dye:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 5, 'But Rebecca hard whe Isaac spake to Esau his sonne. And as soone as Esau was gone to the felde to catche venyson and to brige it');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 6, 'she spake vnto Iacob hir sonne sainge? Behold I haue herde thi father talkinge with Esau thy brother and saynge:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 7, 'bringe me venyson and make me meate that I maye eate and blesse the before the LORde yer I dye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 8, 'Now therfore my sonne heare my voyce in that which I comaunde the:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 9, 'gett the to the flocke and bringe me thece .ij. good kiddes and I will make meate of the for thi father soch as he loueth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 10, 'And thou shalt brige it to thi father and he shal eate yt he maye blysse the before his deth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 11, 'Than sayde Iacob to Rebecca his mother. Beholde Esau mi brother is rugh and I am smooth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 12, 'Mi father shal peradueture fele me ad I shal seme vnto hi as though I wet aboute to begyle hi and so shall he brige a curse vpo me and not a blessige:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 13, 'and his mother saide vnto him. Vppo me be thi curse my sonne only heare my voyce and goo and fetch me them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 14, 'And Iacob went ad fett them and brought them to his mother.And his mother made meate of them accordinge as his father loued');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 15, 'And she went and fett goodly rayment of hir eldest sonne Esau which she had in the house with hir and put them vpon Iacob hir yongest sonne');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 16, 'ad she put the skynnes vpon his hades and apon the smooth of his necke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 17, 'And she put ye meate and brede which she had made in the hode of hir sonne Iacob');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 18, 'And he went in to his father saynge: my father And he aswered: here am I who art thou my sonne?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 19, 'And Iacob sayde vnto his father: I am Esau thy eldest sonne I haue done acordinge as thou baddest me vp and sytt and eate of my venyson that thi soule maye blesse me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 20, 'But Isaac sayde vnto his sonne. How cometh it that thou hast fownde it so quicly my sonne? He answered: The LORde thy god brought it to my hande.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 21, 'Than sayde Isaac vnto Iacob: come nere and let me fele the my sonne whether thou be my sonne Esau or not.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 22, 'Than went Iacob to Isaac his father and he felt him and sayde the voyce is Iacobs voyce but the hades ar ye hades of Esau.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 23, 'And he knewe him not because his handes were rough as his brother Esaus handes: And so he blessed him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 24, 'And he axed him art thou my sonne Esau? And he sayde: that I am.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 25, 'Than sayde he: brynge me and let me eate of my sonnes venyson that my soule maye blesse the. And he broughte him and he ate. And he broughte him wyne also and he dranke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 26, 'And his father Isaac sayde vnto him: come nere and kysse me my sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 27, 'And he wet to him and kissed him. And he smelled ye sauoure of his raymet and blessed hi and sayde See ye smell of my sone is as ye smell of a feld which the lorde hath blessed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 28, 'God geue the of ye dewe of heave and of the fatnesse of the erth and pletie of corne and wyne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 29, 'People be thy servauntes and natios bowe vnto the. Be lorde ouer thy brethre and thy mothers children stoupe vnto the. Cursed be he yt curseth the and lessed be he that blesseth the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 30, 'As soone as Isaac had made an end of blessig Iacob and Iacob was scace gone out fro the preasence of Isaac his father: then came Esau his brother fro his huntynge:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 31, 'And had made also meate and brought it in vnto his father and sayde vnto him: Aryse my father and eate of thy sonnes venyson that thy soule maye blesse me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 32, 'Tha his father Isaac sayde vnto him. Who art thou? he answered I am thy eldest sonne Esau.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 33, 'And Isaac was greatly astoyned out of mesure and sayde: Where is he then that hath huted venyson and broughte it me and I haue eaten of all before thou camest and haue blessed him ad he shall be blessed styll.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 34, 'Whe Esau herde the wordes of his father he cryed out greatly and bitterly aboue mesure and sayde vnto his father: blesse me also my father.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 35, 'And he sayde thy brother came with subtilte ad hath take awaye thy blessynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 36, 'Than sayde he: He maye well be called Iacob for he hath vndermyned me now .ij. tymes fyrst he toke awaye my byrthrighte: and se now hath he taken awaye my blessynge also. And he sayde hast thou kepte neuer a blessynge for me?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 37, 'Isaac answered and sayde vnto Esau: beholde I haue made him thi LORde and all his mothers childern haue I made his seruauntes. Moreouer wyth corne ad wyne haue I stablesshed him what ca I do vnto the now my sonne?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 38, 'And Esau sayde vnto his father? hast thou but yt one blessynge my father? blesse me also my father: so lyfted vp Esau his voyce and wepte');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 39, 'Tha Isaac his father answered and sayde vnto himBeholde thy dwellynge place shall haue of the fatnesse of the erth and of the dewe of heauen fro aboue.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 40, 'And wyth thy swerde shalt thou lyue and shalt be thy brothers seruaunte But the tyme will come when thou shalt gett the mastrye and lowse his yocke from of thy necke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 41, 'And Esau hated Iacob because of the blessynge yt his father blessed him with all and sayde in his harte: The dayes of my fathers sorowe are at hade for I will sley my brother Iacob.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 42, 'And these wordes of Esau hir eldest sonne were told to Rebecca. And she sente ad called Iacob hir yongest sonne and sayde vnto hi: beholde thy brother Esau threatneth to kyll the:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 43, 'Now therfore my sone heare my voyce make the redie and flee to Laba my brother at Haran');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 44, 'And tarie with him a while vntill thy brothers fearsnes be swaged and');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 45, 'vntill thy brothers wrath turne away from the and he forgett that which thou hast done to him. Tha will I sende and fett the awaye from thence. Why shulde I lose you both in one daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 27, 46, 'And Rebecca spake to Isaac: I am wery of my life for feare of the doughters of Heth. Yf Iacob take a wife of the doughters of Heth soch one as these are or of the doughters of the lande what lust shulde I haue to lyue.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 1, 'Than Isaac called Iacob his sonne and blessed him ad charged him and sayde vnto him: se thou take not a wife of the doughters of Canaan');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 2, 'but aryse ad gett the to Mesopotamia to the house of Bethuel thy mothers father: and there take the a wife of the doughters of Laban thi mothers brother.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 3, 'And God allmightie blesse the increase the and multiplie the that thou mayst be a nombre of people');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 4, 'and geue the the blessynge of Abraham: both to the and to thy seed with the that thou mayst possesse the lade (wherein thou art a strangere) which God gaue vnto Abraham.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 5, 'Thus Isaac sent forth Iacob to goo to Mesopotamia vnto Laban sonne of Bethuel the Sirien and brother to Rebecca Iacobs and Esaus mother.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 6, 'When Esau sawe that Isaac had blessed Iacob and sent him to Mesopotamia to fett him a wife thence and that as he blessed him he gaue him a charge saynge: se thou take not a wife of the doughters of Canaan:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 7, 'and that Iacob had obeyed his father and mother and was gone vnto Mesopotamia:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 8, 'and seynge also that the doughters of Canaan pleased not Isaac his father:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 9, 'Then went he vnto Ismael and toke vnto the wiues which he had Mahala the doughter of Ismael Abrahams sonne the sister of Nabaioth to be his wife.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 10, 'Iacob departed from Berseba and went toward Haran');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 11, 'and came vnto a place and taried there all nyghte because the sonne was downe. And toke a stone of the place and put it vnder his heade and layde him downe in the same place to slepe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 12, 'And he dreamed: and beholde there stode a ladder apon the erth and the topp of it reached vpp to heaue. And se the angells of God went vp and downe apon it');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 13, 'yee ad the LORde stode apon it and sayde.I am the LORde God of Abraham thi father and the God of Isaac: The londe which thou slepest apon will I geue the and thy seed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 14, 'And thy seed shalbe as the dust of the erth: And thou shalt spreade abrode: west east north and south. And thorow the and thy seed shall all the kynreddes of the erth be blessed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 15, 'And se I am with the and wylbe thy keper in all places whother thou goost and wyll brynge ye agayne in to this lande: Nether will I leaue the vntill I haue made good all that I haue promysed the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 16, 'When Iacob was awaked out of his slepe he sayde: surely the LORde is in this place ad I was not aware.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 17, 'And he was afrayde and sayde how fearfull is this place? it is none other but euen the house of God and the gate of heaue.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 18, 'And Iacob stode vp early in the mornynge and toke the stone that he had layde vnder his heade and pitched it vp an ende and poured oyle on the topp of it.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 19, 'And he called the name of the place Bethell for in dede the name of the citie was called Lus before tyme.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 20, 'And Iacob vowed a vowe saynge: Yf God will be with me and wyll kepe me in this iourney which I goo and will geue me bread to eate and cloothes to put on');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 21, 'so that I come agayne vnto my fathers house in saftie: then shall the LORde be my God');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 28, 22, 'and this stone which I haue sett vp an ende shalbe godes house And of all that thou shalt geue me will I geue the tenth vnto the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 1, 'Then Iacob lyfte vp his fete and wet toward the east countre.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 2, 'And as he loked aboute behold there was a well in the feld and .iij. flockes of shepe laye therby (for at that well were the flockes watered) and there laye a great stone at the well mouth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 3, 'And the maner was to brynge the flockes thyther and to roull the stone fro the welles mouth and to water the shepe and to put the stone agayne vppon the wells mouth vnto his place.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 4, 'And Iacob sayde vnto the: brethern whece be ye? and they sayde: of Haran ar we.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 5, 'And he sayde vnto the: knowe ye Laban the sonne of Nahor. And they sayde: we knowe him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 6, 'And he sayde vnto the: is he in good health? And they sayde: he is in good health: and boholde his doughter Rahel cometh with ye shepe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 7, 'And he sayde: lo it is yet a great whyle to nyghte nether is it tyme yt the catell shulde be gathered together: water the shepe and goo and fede the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 8, 'And they sayde: we maye not vntill all ye flockes be brought together and the stone be roulled fro the wells mouth and so we water oure shepe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 9, 'Whyle he yet talked with the Rahel came with hir fathers shepe for she kepte them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 10, 'As soone As Iacob sawe Rahel the doughter of Laban his mothers brother and the shepe of Laban his mothers brother he went and rowled the stone fro the wells mouth and watered the shepe of Laba his mothers brother');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 11, 'And Iacob kyssed Rahel and lyfte vp his voyce and wepte:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 12, 'and tolde her also yt he was hir fathers brother and Rebeccas sonne. The Rahel ranne and tolde hir father.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 13, 'When Laban herd tell of Iacob his sisters sonne he ranne agaynst him and embraced hi and kyssed him ad broughte him in to his house. And the Iacob told Laba all ye matter');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 14, 'And the Laba sayde: well thou art my bone and my flesh. Abyde with me the space of a moneth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 15, 'And afterward Laban sayd vnto Iacob: though thou be my brother shuldest thou therfore serue me for nought?tell me what shall thi wages be?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 16, 'And Laban had .ij. doughters the eldest called Lea and the yongest Rahel.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 17, 'Lea was tender eyed: But Rahel was bewtifull ad well fauored.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 18, 'And Iacob loued her well and sayde: I will serue the .vij. yere for Rahel thy yongest doughter.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 19, 'And Laban answered: it is better yt I geue her the than to another man? byde therfore with me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 20, 'And Iacob serued .vij. yeres for Rahel and they semed vnto him but a fewe dayes for the loue he had to her.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 21, 'And Iacob sayde vnto Laban geue me my wife that I maye lye with hir for the tyme appoynted me is come.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 22, 'Than Laban bade all the men of that place and made a feast.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 23, 'And when eue was come he toke Lea his doughter and broughte her to him and he went in vnto her.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 24, 'And Laban gaue vnto his doughter Lea Zilpha his mayde to be hir seruaunte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 25, 'And when the mornynge was come beholde it was Lea. Than sayde he to Laban: wherfore hast thou played thus with me? dyd not I serue the for Rahel wherfore than hast thou begyled me?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 26, 'Laban answered: it is not the maner of this place to marke the yongest before the eldest.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 27, 'Passe out this weke and tha shall this also be geuen the for ye seruyce which thou shalt serue me yet .vij. yeres more.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 28, 'And Iacob dyd eue so and passed out that weke and than he gaue hi Rahel his doughter to wyfe also.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 29, 'And Laban gaue to Rahel his doughter Bilha his handmayde to be hir servaute.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 30, 'So laye he by Rahel also and loued Rahel more than Lea and serued him yet .vij. yeres more.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 31, 'When the LORde sawe that Lea was despised he made her frutefull: but Rahel was baren.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 32, 'And Lea conceaued and bare a sonne ad called his name Rube for she sayde::the LORde hath loked apon my tribulation. And now my husbonde will loue me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 33, 'And she conceaued agayne and bare a sonne and sayde: the LORde hath herde that I am despised ad hath therfore geuen me this sonne also and she called him Simeon.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 34, 'And she conceaued yet and bare a sonne ad sayde: now this once will my husbonde kepe me company because I haue borne him .iij. sonnes: and therfore she called his name Levi.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 29, 35, 'And she conceaued yet agayne and bare a sonne saynge? Now will I prayse the LORde: therfore she called his name Iuda and left bearynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 1, 'When Rahel sawe that she bare Iacob no childern she enuied hir sister and sayde vnto Iacob: geue me childern or ells I am but deed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 2, 'Than was Iacob wrooth with Rahel saynge: Am I in godes steade which kepeth fro the the frute of thi wobe?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 3, 'The she sayde: here is my mayde Bilha: go in vnto her that she maye beare vpo my lappe that I maye be encreased by her.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 4, 'And she gaue him Bilha hir hadmayde to wife. And Iacob wet in vnto her');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 5, 'And Bilha conceaued and bare Iacob a sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 6, 'Than sayde Rahel. God hath geuen sentece on my syde and hath also herde my voyce and hath geuen me a sonne. Therfore called she him Dan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 7, 'And Bilha Rahels mayde coceaued agayne and bare Iacob a nother sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 8, 'And Rahel sayde. God is turned and I haue made achaunge with my sister and haue gote ye vpper hade. And she called his name Nepthali');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 9, 'Whe Lea sawe that she had left bearinge she toke Silpha hir mayde and gaue her Iacob to wiffe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 10, 'And Silpha Leas made bare Iacob a sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 11, 'Than sayde Lea: good lucke: and called his name Gad.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 12, 'And Silpha Leas mayde bare Iacob another sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 13, 'Tha sayd Lea: happy am I for the doughters will call me blessed. And called his name Asser.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 14, 'And Rube wet out in the wheat haruest and foude mandragoras in the feldes and brought the vnto his mother Lea. Than sayde Rahel to Lea geue me of thy sonnes madragoras.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 15, 'And Lea answered: is it not ynough yt thou hast take awaye my housbode but woldest take awaye my sonnes mandragoras also? Than sayde Rahel well let him slepe with the this nyghte for thy sonnes mandragoras.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 16, 'And whe Iacob came from the feldes at euen Lea went out to mete him and sayde: come into me for I haue bought the with my sonnes mandragoras.And he slepte with her that nyghte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 17, 'And God herde Lea yt she coceaued and bare vnto Iacob yt .v. sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 18, 'Than sayde Lea. God hath geue me my rewarde because I gaue my mayde to my housbod and she called him Isachar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 19, 'And Lea coceaued yet agayne and bare Iacob the sexte sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 20, 'Than sayde she: God hath endewed me with a good dowry. Now will my housbond dwell with me because I haue borne him .vi. sonnes: and called his name Zabulo.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 21, 'After that she bare a doughter and called her Dina.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 22, 'And God remebred Rahel herde her and made her frutefull:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 23, 'so that she coceaued and bare a sonne and sayde God hath take awaye my rebuke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 24, 'And she called his name Ioseph saynge The lorde geue me yet a nother sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 25, 'As soone as Rahel had borne Ioseph Iacob sayde to Laban: Sede me awaye yt I maye goo vnto myne awne place and cutre');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 26, 'geue me my wives and my childern for whome I haue serued the and let me goo; for thou knowest what seruyce I haue done the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 27, 'Than sayde Laban vnto hi: If I haue fownde fauoure in thy syghte (for I suppose yt the LORde hath blessed me for thy sake)');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 28, 'appoynte what thy rewarde shalbe and I will geue it ye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 29, 'But he sayde vnto hym thou knowest what seruyce I haue done ye and in what takynge thy catell haue bene vnder me:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 30, 'for it was but litle that thou haddest before I came and now it is encreased in to a multitude and the LORDE hath blessed the for my sake.But now when shall I make provysion for myne awne house also?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 31, 'And he sayde: what shall I geue the? And Iacob answerd: thou shalt geue me nothinge at all yf thou wilt do this one thinge for me: And then will I turne agayne and fede thy shepe and kepe them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 32, 'I will go aboute all thy shepe this daye and separate fro the all the shepe that are spotted and of dyverse coloures and all blacke shepe amonge the lambes and the partie and spotted amonge the kyddes: And then such shalbe my rewarde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 33, 'So shall my rightwesnes answere for me: when the tyme commeth that I shall receaue my rewarde of the: So that what soeuer is not speckeld and partie amonge the gootes and blacke amonge the lambes let that be theft with me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 34, 'Than sayde Laban: loo I am contete that it be acordinge as thou hast sayde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 35, 'And he toke out that same daye the he gootes that were partie and of dyuerse coloures and all the she gootes that were spotted and partie coloured and all that had whyte in the and all the blacke amonge the lambes: ad put the in the kepinge of his sonnes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 36, 'and sett thre dayes ourney ibetwixte hiselfe and Iacob. And so Iacob kepte ye rest of Labas shepe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 37, 'Iacob toke roddes of grene popular hasell and of chestnottrees and pilled whyte strakes in the and made the white apere in the staues:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 38, 'And he put the staues which he had pilled eue before ye shepe in the gutters and watrynge troughes whe the shepe came to drynke: yt they shulde coceaue whe they came to drynke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 39, 'And the shepe coceaued before the staues and brought forth straked spotted and partie.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 40, 'The Iacob parted the labes and turned the faces of the shepe toward spotted thinges and toward all maner of blacke thinges thorow out the flockes of Laba. And he made him flockes of his owne by the selfe which he put not vnto the flockes of Laba.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 41, 'And allwaye in the first buckinge tyme of the shepe Iacob put the staues before the shepe in the gutters yt they myghte conceaue before the staues');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 42, 'But in the latter buckynge tyme he put them not there: so the last brode was Labas and the first Iacobs.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 30, 43, 'And the man became excedynge ryche and had many shepe maydeseruauntes menseruauntes camels and asses.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 1, 'And Iacob herde the wordes of Labas sonnes how they sayde: Iacob hath take awaye all that was oure fathers and of oure fathers goodes hath he gote all this honoure.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 2, 'And Iacob behelde the countenauce of Laban that it was not toward him as it was in tymes past.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 3, 'And the LORde sayde vnto Iacob: turne agayne in to the lade of thy fathers and to thy kynred and I wilbe with ye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 4, 'Tha Iacob sent and called Rahel and Lea to the felde vnto his shepe');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 5, 'and sayde vnto the: I se youre fathers countenauce yt it is not toward me as in tymes past. Morouer ye God of my father hath bene with me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 6, 'And ye knowe how that I haue serued youre father with all my myghte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 7, 'And youre father hath disceaued me and chaunged my wages .x. tymes: But God suffred him not to hurte me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 8, 'When he sayde the spotted shalbe thy wages tha all the shepe barespotted. Yf he sayde the straked shalbe thi rewarde tha bare all the shepe straked:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 9, 'thus hath God take awaye youre fathers catell and geue the me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 10, 'For in buckynge tyme I lifted vp myne eyes and sawe in a dreame: and beholde the rammes that bucked the shepe were straked spotted and partie.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 11, 'And the angell of God spake vnto me in a dreame saynge: Iacob. And I answered: here am I.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 12, 'And he sayde: lyfte vp thyne eyes ad see how all therames that leape vpon the shepe are straked spotted and partie: for I haue sene all that Laban doth vnto ye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 13, 'I am ye god of Bethell where thou anoynteddest the stone ad where thou vowdest a vowe vnto me. Now aryse and gett the out of this countre ad returne vnto the lade where thou wast borne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 14, 'Than answered Rahel and Lea and sayde vnto him: we haue no parte nor enheritaunce in oure fathers house');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 15, 'he cownteth us eue as straungers for he hath solde vs and hath euen eaten vp the price of vs.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 16, 'Moreouer all the riches which God hath take from oure father that is oures and oure childerns. Now therfore what soeuer God hath sayde vnto the that doo.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 17, 'Tha Iacob rose vp and sett his sones and wiues vp vpon camels');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 18, 'and caried away all his catell and all his substace which he had gotte in Mesopotamia for to goo to Isaac his father vnto the lade of Canaan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 19, 'Laba was gone to shere his shepe and Rahel had stolle hir fathers ymages.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 20, 'And Iacob went awaye vnknowynge to Laban the Sirie and tolde him not yt he fled.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 21, 'So fled he and all yt he had and made him self redy and passed ouer the ryuers and sett his face streyght towarde the mounte Gilead.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 22, 'Apo the thirde day after was it tolde Laba yt Iacob was fled.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 23, 'Tha he toke his brethre with him and folowed after him .vij. dayes iourney and ouer toke him at the mounte Gilead.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 24, 'And God came to Laba the Siria in a dreame by nyghte and sayde vnto him: take hede to thi selfe that thou speake not to Iacob oughte save good.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 25, 'And Laba ouer toke Iacob: and Iacob had pitched his tete in yt mounte. And Laban with his brethern pitched their tete also apon the mounte Gilead.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 26, 'Than sayde Laba to Iacob: why hast thou this done vnknowynge to me and hast caried awaye my doughters as though they had bene take captyue with swerde?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 27, 'Wherfore wentest thou awaye secretly vnknowne to me and didest not tell me yt I myghte haue broughte yt on the waye with myrth syngynge tymrells and harppes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 28, 'and hast not suffred me to kysse my childern and my doughters. Thou wast a fole to do');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 29, 'it for I am able to do you evell. But the God of youre father spake vnto me yesterdaye saynge take hede tha thou speake not to Iacob oughte saue goode.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 30, 'And now though thou wetest thi waye because thou logest after thi fathers house yet wherfore hast thou stollen my goddes?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 31, 'Iacob answered and sayde to Laba: because I was afrayed and thought that thou woldest haue take awaye thy doughters fro me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 32, 'But with whome soeuer thou fyndest thy goddes let him dye here before oure brethre. Seke that thine is by me and take it to the: for Iacob wist not that Rahel had stolle the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 33, 'Tha wet Laba in to Iacobs tete and in to Leas tete and in to .ij. maydens tentes: but fownde the not. Tha wet he out of Leas tete and entred in to Rahels tete.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 34, 'And Rahel toke the ymages and put them in the camels strawe and sate doune apo the. And Laba serched all the tete: but fownde the not.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 35, 'Tha sayde she to hir father: my lorde be not angrye yt I ca not ryse vp before the for the disease of weme is come apon me. So searched he but foude the not.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 36, 'Iacob was wrooth and chode with Laba: Iacob also answered and sayde to him: what haue I trespaced or what haue I offended that thou foloweddest after me?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 37, 'Thou hast searched all my stuffe and what hast thou founde of all thy housholde stuffe? put it here before thi brethern and myne and let the iudge betwyxte vs both.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 38, 'This xx. yere yt I haue bene wyth the thy shepe and thy gootes haue not bene baren and the rammes of thi flocke haue I not eate.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 39, 'What soeuer was torne of beastes I broughte it not vnto ye but made it good mysilf: of my hade dydest thou requyre it whether it was stollen by daye or nyghte');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 40, 'Moreouer by daye the hete consumed me and the colde by nyghte and my slepe departed fro myne eyes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 41, 'Thus haue I bene .xx. yere in thi house and serued the .xiiij. yeres forthy .ij. doughters and vi. yere for thi shepe and thou hast changed my rewarde .x. tymes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 42, 'And excepte the God of my father the God of Abraha and the God whome Isaac feareth had bene with me: surely thou haddest sent me awaye now all emptie. But God behelde my tribulation and the laboure of my handes: and rebuked the yester daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 43, 'Laban answered ad sayde vnto Iacob: the doughters are my doughters and the childern ar my childern and the shepe are my shepe ad all that thou seist is myne. And what can I do this daye vnto these my doughters or vnto their childern which they haue borne?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 44, 'Now therfore come on let us make a bonde I and thou together and let it be a wytnesse betwene the and me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 45, 'Than toke Iacob a stone and sett it vp an ende');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 46, 'ad sayde vnto his brethern gather stoones And they toke stoones ad made an heape and they ate there vpo the heape.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 47, 'And Laba called it Iegar Sahadutha but Iacob called it Gylead.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 48, 'Than sayde Laban: this heape be witnesse betwene the and me this daye (therfore is it called Gilead)');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 49, 'and this totehill which the lorde seeth (sayde he) be wytnesse betwene me and the when we are departed one from a nother:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 50, 'that thou shalt not vexe my doughters nether shalt take other wyves vnto them. Here is no man with vs: beholde God is wytnesse betwixte the and me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 51, 'And Laban sayde moreouer to Iacob: beholde this heape and this marke which I haue sett here betwyxte me and the:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 52, 'this heape be wytnesse and also this marcke that I will not come ouer this heape to the ad thou shalt not come ouer this heape ad this marke to do any harme.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 53, 'The God of Abraham the God of Nahor and the God of theyr fathers be iudge betwixte vs.And Iacob sware by him that his father Isaac feared.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 54, 'Then Iacob dyd sacrifyce vpon the mounte and called his brethern to eate breed. And they ate breed and taried all nyghte in the hyll.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 31, 55, 'And early in the mornynge Laban rose vp and kyssed his childern and his doughters and blessed the and departed and wet vnto his place agayne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 1, 'But Iacob went forth on his iourney. And the angells of God came and mett him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 2, 'And when Iacob sawe them he sayde: this is godes hoost: and called the name of that same place Mahanaim.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 3, 'Iacob sente meessengers before him to Esau his brother vnto the lande of Seir and the felde of Edom.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 4, 'And he comaunded them saynge: se that ye speake after this maner to my lorde Esau: thy seruaunte Iacob sayth thus. I haue sogerned ad bene a straunger with Laban vnto this tyme:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 5, 'and haue gotten oxen asses and shepe menservauntes and wemanseruauntes and haue sent to shewe it mi lorde that I may fynde grace in thy syghte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 6, 'And the messengers came agayne to Iacob sainge: we came vnto thi brother Esau and he cometh ageynst the and .iiij. hundred men with hi.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 7, 'Than was Iacob greatlye afrayde and wist not which waye to turne him selfe and devyded the people that was with him and the shepe oxen and camels in to .ij. companies');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 8, 'and sayde: Yf Esau come to the one parte and smyte it the other may saue it selfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 9, 'And Iacob sayde: O god of my father Abraham and God of my father Isaac: LORde which saydest vnto me returne vnto thy cuntre and to thy kynrede and I will deall wel with the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 10, 'I am not worthy of the leaste of all the mercyes and treuth which thou hast shewed vnto thy seruaunte. For with my staf came I over this Iordane and now haue Igoten .ij. droves');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 11, 'Delyver me from the handes of my brother Esau for I feare him: lest he will come and smyte the mother with the childeru.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 12, 'Thou saydest that thou woldest surely do me good and woldest make mi seed as the sonde of the see which can not be nombred for multitude.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 13, 'And he taried there that same nyghte and toke of that which came to hande a preasent vnto Esau his brother:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 14, 'ij hundred she gootes ad xx he gootes: ij hundred shepe and xx rammes:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 15, 'thyrtye mylch camels with their coltes: xl kyne ad x bulles: xx she asses ad foles');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 16, 'and delyuered them vnto his seruauntes euery drooue by them selues ad sayde vnto them: goo forth before me and put a space betwyxte euery drooue.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 17, 'And he comaunded the formest sayngeWhe Esau my brother meteth the ad axeth the saynge: whose seruaute art thou and whither goost thou and whose ar these that goo before ye:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 18, 'thou shalt say they be thy seruaunte Iacobs and are a present sent vnto my lorde Esau and beholde he him selfe cometh after vs.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 19, 'And so comaunded he the seconde ad euen so the thirde and lykewyse all that folowed the drooues sainge of this maner se that ye speake vnto Esau whe ye mete him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 20, 'ad saye more ouer. Beholde thy seruaunte Iacob cometh after vs for he sayde. I will pease his wrath with the present yt goth before me and afterward I will see him myself so peradventure he will receaue me to grace.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 21, 'So went the preset before him ad he taried all that nyghte in the tente');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 22, 'ad rose vp the same nyghte ad toke his .ij. wyves and his .ij. maydens and his .xi. sonnes and went ouer the foorde Iabok.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 23, 'And he toke them ad sent the ouer the ryuer ad sent ouer that he had');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 24, 'ad taried behinde him selfe alone.And there wrastled a man with him vnto the breakynge of the daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 25, 'And when he sawe that he coude not prevayle agaynst him he smote hi vnder the thye and the senowe of Iacobs thy shranke as he wrastled with him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 26, 'And he sayde: let me goo for the daye breaketh. And he sayde: I will not lett the goo excepte thou blesse me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 27, 'And he sayde vnto him: what is thy name? He answered: Iacob.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 28, 'And he sayde: thou shalt be called Iacob nomore but Israell. For thou hast wrastled with God and with men ad hast preuayled.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 29, 'And Iacob asked him sainge tell me thi name. And he sayde wherfore dost thou aske after my name? and he blessed him there.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 30, 'And Iacob called the name of the place Peniel for I haue sene God face to face and yet is my lyfe reserved.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 31, 'And as he went ouer Peniel the sonne rose vpon him and he halted vpon his thye:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 32, 32, 'wherfore the childern of Israell eate not of the senow that shrancke vnder the thye vnto this daye: because that he smote Iacob vnder the thye in the senow that shroncke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 1, 'Iacob lyfte vp his eyes and sawe hys brother Esau come and with him .iiij. hundred men. And he deuyded the childern vnto Lea and vnto Rahel and vnto ye ij. maydens.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 2, 'And he put the maydens ad their childern formest ad Lea and hir childern after and Rahel ad Ioseph hindermost.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 3, 'And he went before them and fell on the grownde, vij. tymes vntill he came vnto his brother.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 4, 'Esau ranne agaynst him and enbraced hym and fell on his necke and kyssed him and they wepte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 5, 'And he lifte vp his eyes and sawe the wyves and their childern and sayde: what are these which thou there hast? And he sayde: they are the childern which God hath geuen thy seruaunte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 6, 'Than came the maydens forth ad dyd their obaysaunce.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 7, 'Lea also and hir childern came and dyd their obaysaunce. And last of all came Ioseph and Rahel and dyd their obaysaunce.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 8, 'And he sayde: what meanyst thou with all ye drooues which I mett. And he answered: to fynde grace in the syghte of my lorde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 9, 'And Esau sayde: I haue ynough my brother kepe that thou hast vnto thy silf.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 10, 'Iacob answered: oh nay but yf I haue founde grace in thy syghte receaue my preaset of my hade: for I haue sene thy face as though I had sene ye face of God: wherfore receaue me to grace');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 11, 'and take my blessynge that I haue brought the for God hath geuen it me frely. And I haue ynough of all thynges. And so he compelled him to take it.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 12, 'And he sayde: let us take oure iourney and goo and I will goo in thy copany.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 13, 'And he sayde vnto him: my lorde knoweth that I haue tendre childern ewes and kyne with yonge vnder myne hande which yf men shulde ouerdryue but euen one daye the hole flocke wolde dye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 14, 'Let my lorde therfore goo before his servaunte and I will dryue fayre and softly accordynge as the catell that goth before me and the childern be able to endure: vntill I come to mi lorde vnto Seir.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 15, 'And Esau sayde: let me yet leaue some of my folke with the. And he sayde: what neadeth it? let me fynde grace in the syghte of my lorde');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 16, 'So Esau went his waye agayne yt same daye vnto Seir.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 17, 'And Iacob toke his iourney toward Sucoth and bylt him an house and made boothes for his catell: wherof the name of the place is called Sucoth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 18, 'And Iacob went to Salem to ye cytie of Sichem in the lande of Canaa after that he was come from Mesopotamia and pitched before the cyte');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 19, 'and bought a parcell of ground where he pitched his tent of the childern of Hemor Sichems father for an hundred lambes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 33, 20, 'And he made there an aulter and there called vpon the myghtie God of Israell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 1, 'Dina the doughter of Lea which she bare vnto Iacob went out to see the doughters of the lande.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 2, 'And Siche the sonne of Hemor the Heuite lorde of the countre sawe her and toke her and laye with her and forced her:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 3, 'and his harte laye vnto Dina ye doughter of Iacob. And he loued yt damsell and spake kidly vnto her');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 4, 'and spake vnto his father Hemor saynge gett me this mayde vnto my wyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 5, 'And Iacob herde that he had defyled Dina his doughter but his sonnes were with the catell in the felde and therfore he helde his peace vntill they were come.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 6, 'Then Hemor the father of Sichem went out vnto Iacob to come with him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 7, 'And the sonnes of Iacob came out of the felde as soone as they herde it for it greued them and they were not a litle wrooth because he had wrought folie in Israell in that he had lyen with Iacobs doughter which thinge oughte not to be done.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 8, 'And Hemor comened with the sainge? the soule of my sonne Siche logeth for youre doughter geue her him to wyfe');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 9, 'and make mariages with vs: geue youre doughters vnto vs ad take oure doughters vnto you');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 10, 'and dwell with vs and the lande shall be at youre pleasure dwell and do youre busynes and haue youre possessions there in.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 11, 'And Sichem sayde vnto hyr father and hir brethern: let me fynde grace in youre eyes and what soeuer ye apoynte me that will I geue.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 12, 'Axe frely of me both the dowry and gyftes and I will geue acordynge as ye saye vnto me and geue me the damsell to wyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 13, 'Then the sonnes of Iacob answered to Sichem ad Hemor his father deceytefully because he had defyled Dina their syster.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 14, 'And they sayde vnto them we can not do this thinge yt we shulde geue oure syster to one that is vncircumcysed for that were a shame vnto us.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 15, 'Only in this will we consent vnto you? Yf ye will be as we be that all the men childern amonge you be circumcysed');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 16, 'tha will we geue oure doughter to you and take youres to vs and will dwell with you and be one people.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 17, 'But and yf ye will not harken vnto vs to be circumcysed than will we take oure doughter and goo oure wayes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 18, 'And their wordes pleased Hemor and Sichem his sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 19, 'And the yonge man deferde not for to do the thinge because he had a lust to Iacobs doughter: he was also most sett by of all that were in his fathers house.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 20, 'Tha Hemor and Sichem went vnto the gate of their cyte and comened with the men of their cyte sayncte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 21, 'These men ar peasable with us and will dwell in the lade and do their occupatio therin And in the land is rowme ynough for the let us take their doughters to wyues and geue them oures:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 22, 'only herin will they consent vnto vs for to dwell with vs and to be one people: yf all the men childern that are amonge vs be circumcysed as they are.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 23, 'Their goodes and their substance and all their catell are oures only let vs consente vnto them that they maye dwell with vs.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 24, 'And vnto Hemor and Sichem his sonneharkened all that went out at the gate of his cyte. And all the men childern were circumcysed what soeuer went out at the gates of his cyte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 25, 'And the third daye when it was paynefull to them ij. of the sonnes of Iacob Simeon and Leui Dinas brethren toke ether of them his swerde and went in to the cyte boldly and slewe all yt was male');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 26, 'and slewe also Hemor and Sichem his sonne with the edge of the swerde ad toke Dina their sister out of Sichems house and went their waye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 27, 'Than came the sonnes of Iacob vpon the deede and spoyled the cyte because they had defyled their sister:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 28, 'and toke their shepe oxen asses and what so euer was in the cyte and also in ye feldes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 29, 'And all their goodes all their childern and their wyues toke they captyue and made havock of all that was in the houses.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 30, 'And Iacob sayde to Simeon and Leui: ye haue troubled me ad made me styncke vnto the inhabitatours of the lande both to the Canaanytes and also vnto the Pherezites. And I am fewe in nombre. Wherfore they shall gather them selves together agaynst me and sley me and so shall I and my house be dystroyed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 34, 31, 'And they answered: shuld they deall with oure sister as wyth an whoore?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 1, 'And God sayd vnto Iacob aryse ad get the vp to Bethell and dwell there. And make there an aulter vnto God that apeared vnto the when thou fleddest from Esau thy brother.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 2, 'Than sayd Iacob vnto his housholde and to all yt were with him put away the strauge goddes that are amonge you and make youre selues cleane and chaunge youre garmetes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 3, 'and let vs aryse and goo vp to Bethell yt I maye make an aulter there vnto God which herde me in the daye of my tribulatio and was wyth me in the waye which I went.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 4, 'And they gaue vnto Iacob all the straunge goddes which were vnder their handes ad all their earynges which were in their eares and Iacob hyd them vnder an ooke at Sichem.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 5, 'And they departed. And the feare of God fell vpon the cyties that were rounde aboute them that they durst not folowe after the sonnes of Iacob.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 6, 'So came Iacob to Lus in the lande of Canaan otherwise called Bethell with all the people that was with him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 7, 'And he buylded there an aulter and called the place Elbethell: because that God appered vnto him there when he fled from his brother.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 8, 'Than dyed Deborr Rebeccas norse and was buryed benethe Bethell vnder an ooke. And the name of it was called the ooke of lamentation.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 9, 'And God appeared vnto Iacob agayne after he came out of Mesopotamia and blessed him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 10, 'and sayde vnto him: thy name is Iacob. Notwithstondynge thou shalt be nomore called Iacob but Israel shalbe thy name. And so was his name called Israell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 11, 'And God sayde vnto him: I am God allmightie growe and multiplye: for people and a multitude of people shall sprynge of the yee ad kynges shall come out of they loynes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 12, 'And the lande which I gaue Abraha and Isaac will I geue vnto the and vnto thi seed after the will I geue it also.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 13, 'And god departed fro him in the place where he talked with him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 14, 'And Iacob set vp a marke in the place where he talked with him: euen a pilloure of stone and powred drynkeoffringe theron and powred also oyle theron');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 15, 'and called the name of the place where God spake with him Bethell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 16, 'And they departed from Bethel and when he was but a feld brede from Ephrath Rahel began to trauell. And in travelynge she was in perell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 17, 'And as she was in paynes of hir laboure the mydwyfe sayde vnto her: feare not for thou shalt haue this sonne also.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 18, 'Then as hir soule was a departinge that she must dye: she called his name Ben Oni. But his father called him Ben Iamin.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 19, 'And thus dyed Rahel ad was buryed in the waye to Ephrath which now is called Bethlehem.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 20, 'And Iacob sett vp a piller apon hir graue which is called Rahels graue piller vnto this daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 21, 'And Israell went thece and pitched vp his tent beyonde the toure of Eder.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 22, 'And it chaunced as Israel dwelt in that lande that Ruben went and laye with Bilha his fathers concubyne and it came to Israels eare. The sonnes of Iacob were .xij. in nombre.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 23, 'The sonnes of Lea. Ruben Iacobs eldest sonne and Simeo Leui Iuda Isachar and Zabulon');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 24, 'The sonnes of Rahel: Ioseph and Ben Iamin.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 25, 'The sonnes of Bilha Rahels mayde: Dan and Nepthali.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 26, 'The sonnes of Zilpha Leas mayde Gad and Aser. Thes are the sones of Iacob which were borne him in Mesopotamia.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 27, 'Then Iacob went vnto Isaac his father to Mamre a pricipall cyte otherwise called Hebron: where Abraha and Isaac sogeorned as straungers.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 28, 'And the dayes of Isaac were an hundred and .lxxx. yeres:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 35, 29, 'and than fell he seke and dyed ad was put vnto his people: beynge olde and full of dayes. And his sonnes Esau ad Iacob buried him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 1, 'These are the generations of Esau which is called Edo.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 2, 'Esau toke his wyues of the doughters of Canaan Ada the doughter of Elon an Hethite and Ahalibama the doughter of Ana which Ana was the sonne of Zibeon an heuyte');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 3, 'And Basmath Ismaels doughter and sister of Nebaioth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 4, 'And Ada bare vnto Esau Eliphas: and Basmath bare Reguel:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 5, 'And Ahalibama bare Ieus Iaelam and Rorah. These are the sonnes of Esau which were borne him in the lande of Canaan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 6, 'And Esau toke his wyues his sonnes and doughters and all the soules of his house: his goodes and all his catell and all his substance which he had gott in the land of Canaan ad went in to a countre awaye from his brother Iacob:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 7, 'for their ryches was so moch that they coude not dwell together and that the land where in they were straungers coude not receaue the: because of their catell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 8, 'Thus dwelt Esau in moute Seir which Esau is called Edo');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 9, 'These are the generations of Esau father of the Edomytes in mounte Seir');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 10, 'and these are the names of Esaus sonnes: Eliphas the sonne of Ada the wife of Esau ad Reguel the sonne of Basmath the wife of Esau also.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 11, 'And the sonnes of Eliphas were. Theman Omar Zepho Gactham and kenas.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 12, 'And thimna was concubyne to Eliphas Esaus sonne and bare vnto Eliphas Amalech. And these be the sonnes of Ada Esaus wyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 13, 'And these are the sonnes of Reguel: Nahath Serah Samma and Misa: these were the sonnes of Basmath Esaus wyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 14, 'And these were the sonnes of Ahalibama Esaus wyfe the doughter of Ana sonne of Zebeo which she bare vnto Esau: Ieus Iealam and Korah.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 15, 'These were dukes of the sonnes of Esau. The childern of Eliphas the first sone of Esau were these: duke Theman duke Omar duke Zepho duke Kenas');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 16, 'duke Korah duke Gaetham and duke Amalech: these are ye dukes that came of Eliphas in the lande of Edom ad these were the sonnes of Ada.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 17, 'These were the childern of Requel. Esaus sonne: duke Nahath duke Serah duke Samma duke Misa. These are the dukes that came of Reguel in the lande of Edom ad these were the sonnes of Basmath Esaus wyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 18, 'These were the childern of Ahalibama Esaus wife: duke Ieus duke Iaelam duke Korah these dukes came of Ahalibama ye doughter of Ana Esaus wife.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 19, 'These are the childern of Esau and these are the dukes of them: which Esau is called Edom:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 20, 'These are the childern of Seir the Horite the in habitoure of the lande: Lothan Sobal Zibeon Ana');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 21, 'Dison Eser and Disan. These are the dukes of ye horites the childern of Seir in the lande of Edom.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 22, 'And the childern of Lothan were: Hori and Hemam. And Lothans sister was called Thimna.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 23, 'The childern of Sobal were these: Alvan Manahath Ebal Sepho and Onam.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 24, 'These were the childern of Zibeo. Aia and ana this was yt Ana yt foude ye mules in ye wildernes as he fed his father Zibeons asses.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 25, 'The childern of Ana were these. Dison and Ahalibama ye doughter of Ana.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 26, 'These are the childern of Dison. Hemdan Esban Iethran and Chera.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 27, 'The childern of Ezer were these Bilhan Seavan and Akan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 28, 'The childern of Disan were: Vzand Aran.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 29, 'These are the dukes that came of Hori: duke Lothan duke Sobal duke Zibeo duke Ana');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 30, 'duke Dison duke Ezer duke Disan. These be the dukes that came of Hory in their dukedos in the land of Seir.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 31, 'These are the kynges that reigned in the lande of Edom before there reigned any kynge amonge the childern of Israel.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 32, 'Bela the sonne of Beor reigned in Edomea and the name of his cyte was Dinhaba.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 33, 'And when Bela dyed Iobab the sonne of Serah out of Bezara reigned in his steade.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 34, 'When Iobab was dead Husam of the lande of Themany reigned in his steade.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 35, 'And after the deth of Husam Hadad the sonne of Bedad which stewe the Madianytes in the feld of the Moabytes reigned in his steade and the name of his cyte was Avith.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 36, 'Whe Hadad was dead Samla of Masteka reigned in his steade.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 37, 'Whe Samla was dead Saul of the ryver Rehoboth reigned in his steade.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 38, 'When Saul was dead Baalhanan the sonne of Achbor reigned in his steade.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 39, 'And after the deth of Baal Hanan the sonne of Achbor Hadad reigned in his steade and the name of his cyte was Pagu. And his wifes name Mehetabeel the doughter of matred the doughter of Mesaab.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 40, 'These are the names of the dukes that came of Esau in their kynreddds places and names: Duke Thimma duke Alua duke Ietheth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 41, 'duke Ahalibama duke Ela duke Pinon');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 42, 'duke Kenas duke Theman duke Mibzar');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 36, 43, 'duke Magdiel duke Iram. These be the dukes of Edomea in their habitations in the lande of their possessions. This Esau is the father of the Edomytes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 1, 'And Iacob dwelt in the lande wherein his father was a straunger yt is to saye in the lande of Canaan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 2, 'And these are the generations of Iacob: when Ioseph was .xvij. yere olde he kepte shepe with his brethren and the lad was with the sonnes of Bilha and of Zilpha his fathers wyues. And he brought vnto their father an euyll saynge yt was of them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 3, 'And Israel loued Ioseph more than all his childern because he begat hym in his olde age and he made him a coote of many coloures.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 4, 'When his brothren sawe that their father loued him more than all his brethern they hated him and coude not speke one kynde worde vnto him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 5, 'Moreouer Ioseph dreamed a dreawe and tolde it his brethren: wherfore they hated him yet the more.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 6, 'And he sayde vnto them heare I praye yow this dreame which I haue dreamed:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 7, 'Beholde we were makynge sheues in the felde: and loo my shefe arose and stode vpright and youres stode rounde aboute and made obeysaunce to my shefe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 8, 'Than sayde his brethren vnto him: what shalt thou be oure kynge or shalt thou reigne ouer us? And they hated hi yet the more because of his dreame and of his wordes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 9, 'And he dreamed yet another dreame and told it his brethren saynge: beholde I haue had one dreame more: me thought the sonne and the moone and .xi. starres made obaysaunce to me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 10, 'And when he had told it vnto his father and his brethern his father rebuked him and sayde vnto him: what meaneth this dreame which thou hast dreamed: shall I and thy mother and thy brethren come and fall on the grounde before the?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 11, 'And his brethern hated him but his father noted the saynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 12, 'His brethren went to kepe their fathers shepe in Sichem');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 13, 'and Israell sayde vnto Ioseph: do not thy brethern kepe in Sichem? come that I may send ye to the. And he answered here am I');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 14, 'And he sayde vnto him: goo and see whether it be well with thy brethren and the shepe and brynge me worde agayne: And sent him out of the vale of Hebron for to go to Sichem.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 15, 'And a certayne man founde him wandrynge out of his waye in the felde ad axed him what he soughte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 16, 'And he answered: I seke my brethren tell me I praye the where they kepe shepe');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 17, 'And the man sayde they are departed hece for I herde them say let vs goo vnto Dothan. Thus went Ioseph after his brethren and founde them in Dothan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 18, 'And whe they sawe him a farr of before he came at them they toke councell agaynst him for to sley him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 19, 'and sayde one to another Beholde this dreamer cometh');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 20, 'come now and let us sley him and cast him in to some pytt and let vs saye that sonne wiked beast hath deuoured him and let us see what his dreames wyll come to.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 21, 'When Ruben herde that he wet aboute to ryd him out of their handes and sayde let vs not kyll him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 22, 'And Ruben sayde moreouer vnto them shed not his bloude but cast him in to this pytt that is in the wildernes and laye no handes vpon him: for he wolde haue rydd him out of their handes and delyuered him to his father agayne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 23, 'And as soone as Ioseph was come vnto his brethren they strypte him out of his gay coote that was vpon him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 24, 'and they toke him and cast him in to a pytt: But the pytt was emptie and had no water therein.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 25, 'And they satt them doune to eate brede. And as they lyft vp their eyes and loked aboute there came a companye of Ismaelites from Gilead and their camels lade with spicery baulme and myrre and were goynge doune in to Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 26, 'Than sayde Iuda to his brethre what avayleth it that we sley oure brother and kepe his bloude secrett?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 27, 'come on let vs sell him to the Ismaelites and let not oure handes be defyled vpon him: for he is oure brother and oure flesh. And his brethren were content.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 28, 'Than as the Madianites marchaunt men passed by they drewe Ioseph out of the pytt and sold him vnto the Ismaelites for .xx. peces of syluer.And they brought him into Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 29, 'And when Ruben came agayne vnto the pytt and founde not Ioseph there he rent his cloothes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 30, 'and went agayne vnto his brethern saynge: the lad is not yonder and whether shall I goo?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 31, 'And they toke Iosephs coote ad kylled a goote and dypped the coote in the bloud.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 32, 'And they sent that gay coote and caused it to be brought vnto their father and sayd: This haue we founde: se whether it be thy sones coote or no.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 33, 'And he knewe it saynge: it is my sonnes coote a wicked beast hath deuoured him and Ioseph is rent in peces.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 34, 'And Iacob rent his cloothes ad put sacke clothe aboute his loynes and sorowed for his sonne a longe season.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 35, 'Than came all his sonnes ad all his doughters to comforte him. And he wold not be comforted but sayde: I will go doune in to ye grave vnto my sonne mornynge. And thus his father wepte for him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 37, 36, 'And the Madianytes solde him in Egipte vnto Putiphar a lorde of Pharaos: and his chefe marshall.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 1, 'And it fortuned at that tyme that Iudas went from his brethren and gatt him to a man called Hira of Odollam');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 2, 'and there he sawe the doughter of a man called Sua a Canaanyte. And he toke her ad went in vnto her.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 3, 'And she conceaued and bare a sonne and called his name Er.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 4, 'And she conceaued agayne and bare a sonne and called him Onan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 5, 'And she conceaued the thyrde tyme and bare a sonne whom she called Scla: and he was at Chesyb when she bare hem.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 6, 'And Iudas gaue Er his eldest sonne a wife whose name was Thamar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 7, 'But this Er Iudas eldest sonne was wicked in the syghte of the LORde wherfore the LORde slewe him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 8, 'Than sayde Iudas vnto Onan: goo in to thi brothers wyfe and Marie her and styrre vp seed vnto thy brother.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 9, 'And when Onan perceaued that the seed shulde not be his: therfore when he went in to his brothers wife he spylled it on the grounde because he wold not geue seed vnto his brother.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 10, 'And the thinge which he dyd displeased the LORde wherfore he slew him also.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 11, 'Than sayde Iudas to Thamar his doughter in lawe: remayne a wydow at thi fathers house tyll Sela my sonne be growne: for he feared lest he shulde haue dyed also as his brethren did. Thus went Thamar and dwelt in hir fathers house.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 12, 'And in processe of tyme the doughter of Sua Iudas wife dyed. Than Iudas when he had left mornynge went vnto his shepe sherers to Thimnath with his frende Hira of Odollam.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 13, 'And one told Thamar saynge: beholde thy father in lawe goth vp to Thimnath to shere his shepe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 14, 'And she put hyr wydows garmetes of from her and couered her with a clooke and disgyssed herself: And sat her downe at the entrynge of Enaim which is by the hye wayes syde to Thimnath for because she sawe that Sela was growne and she was not geue vnto him to wife.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 15, 'When Iuda sawe her he thought it had bene an hoore because she had couered hyr face.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 16, 'And turned to her vnto the waye and sayde come I praye the let me lye with the for he knewe not that it was his doughter in lawe. And she sayde what wylt thou gyue me for to lye with me?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 17, 'Tha sayde he I will sende the a kydd fro the flocke. She answered Than geue me a pledge till thou sende it.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 18, 'Than sayde he what pledge shall I geue the? And she sayde: they sygnett thy necke lace and thy staffe that is in thy hande. And he gaue it her and lay by her and she was with child by him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 19, 'And she gatt her vp and went and put her mantell from her ad put on hir widowes rayment agayne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 20, 'And Iudas sent the kydd by his neybure of Odollam for to fetch out his pledge agayne from the wifes hande. But he fownde her not.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 21, 'Than asked he the men of the same place saynge: where is the whoore that satt at Enaim in the waye? And they sayde: there was no whoore here.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 22, 'And he came to Iuda agayne saynge: I can not fynde her and also the men of the place sayde: that there was no whoore there.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 23, 'And Iuda sayde: let her take it to her lest we be shamed: for I sente the kydd and thou coudest not fynde her.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 24, 'And it came to passe that after .iij. monethes one tolde Iuda saynge: Thamar thy doughter in lawe hath played the whoore and with playnge the whoore is become great with childe. And Iuda sayde: brynge her forth ad let her be brente.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 25, 'And when they brought her forth she sent to her father in lawe saynge: by the ma vnto whome these thinges pertayne am I with childe. And sayd also: loke whose are this seall necklace and staffe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 26, 'And Iuda knewe them saynge: she is more rightwes tha I because I gaue her not to Sela my sone. But he laye with her nomore.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 27, 'When tyme was come that she shulde be delyuered beholde there was .ij. twynnes in hyr wobe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 28, 'And as she traveled the one put out his hande and the mydwife toke and bownde a reed threde aboute it saynge: this wyll come out fyrst.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 29, 'But he plucked his hande backe agayne and his brother came out. And she sayde: wherfore hast thou rent a rent vppon the? and called him Pharez.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 38, 30, 'And afterward came out his brother that had the reade threde about his hade which was called Zarah.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 1, 'Ioseph was brought vnto Egipte ad Putiphar a lorde of Pharaos: ad his chefe marshall an Egiptian bought him of ye Ismaelites which brought hi thither');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 2, 'And the LORde was with Ioseph and he was a luckie felowe and continued in the house of his master the Egiptian.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 3, 'And his master sawe that the ORde was with him and that the LORde made all that he dyd prosper in his hande:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 4, 'Wherfore he founde grace in his masters syghte and serued him. And his master made him ruelar of his house and put all that he had in his hande.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 5, 'And as soone as he had made him ruelar ouer his house ad ouer all that he had the LORde blessed this Egiptians house for Iosephs sake and the blessynge of the LORde was vpon all that he had: both in the house and also in the feldes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 6, 'And therfore he left all that he had in Iosephs hande and loked vpon nothinge that was with him saue only on the bread which he ate. And Ioseph was a goodly persone and a well favored');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 7, 'And it fortuned after this that his masters wife cast hir eyes vpon Ioseph and sayde come lye with me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 8, 'But he denyed and sayde to her: Beholde my master woteth not what he hath in the house with me but hath commytted all that he hath to my hande');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 9, 'He him selfe is not greatter in the house than I ad hath kepte nothige fro me but only the because thou art his wife. How than cam I do this great wykydnes for to synne agaynst God?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 10, 'And after this maner spake she to Ioseph daye by daye: but he harkened not vnto her to slepe nere her or to be in her company.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 11, 'And it fortuned aboute the same season that Ioseph entred in to the house to do his busynes: and there was none of the houshold by in the house.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 12, 'And she caught him by the garment saynge: come slepe with me. And he left his garment in hir hande ad fled and gott him out');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 13, 'when she sawe that he had left his garmet in hir hande and was fled out');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 14, 'she called vnto the men of the house and tolde them saynge: Se he hath brought in an Hebrewe vnto vs to do vs shame. for he came in to me for to haue slept myth me. But I cried with a lowde voyce.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 15, 'And when he harde that I lyfte vp my voyce and cryed he left his garment with me and fled awaye and got him out.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 16, 'And she layed vp his garment by her vntill hir lorde came home.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 17, 'And she told him acordynge to these wordes saynge. This Hebrues servaunte which thou hast brought vnto vs came in to me to do me shame.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 18, 'But as soone as I lyft vp my voyce and cryed he left his garment with me and fled out.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 19, 'When his master herde the woordes of his wyfe which she tolde him saynge: after this maner dyd thy servaunte to me he waxed wrooth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 20, 'And he toke Ioseph and put him in pryson: euen in the place where the kinges prisoners laye bounde. And there contynued he in preson.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 21, 'But the LORde was with Ioseph ad shewed him mercie and gott him fauoure in the syghte of the keper of ye preson');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 22, 'which commytted to Iosephe hade all the presoners that were in the preson housse. And what soeuer was done there yt dyd he.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 39, 23, 'And the keper of the preso loked vnto nothinge that was vnder his hande because the LORde was with him and because that what soeuer he dyd the LORde made it come luckely to passe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 1, 'And it chaunced after this that the chefe butlar of the kynge of Egipte and his chefe baker had offended there lorde the kynge of Egypte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 2, 'And Pharao was angrie with them and put the in warde in his chefe marshals house:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 3, 'euen in ye preson where Ioseph was bownd.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 4, 'And the chefe marshall gaue Ioseph a charge with them and he serued them. And they contynued a season in warde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 5, 'And they dreamed ether of them in one nyghte: both the butlar and the baker of the kynge of Egipte which were bownde in the preson house ether of them his dreame and eche manes dreame of a sondrie interpretation');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 6, 'When Ioseph came in vnto them in the mornynge and loked apon them: beholde they were sadd.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 7, 'And he asked them saynge wherfore loke ye so sadly to daye?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 8, 'They answered him we haue dreamed a dreame and haue no man to declare it. And Ioseph sayde vnto the. Interpretynge belongeth to God but tel me yet.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 9, 'And the chefe butlar tolde his dreame to Ioseph and sayde vnto him. In my dreame me thought there stode a vyne before me');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 10, 'and in the vyne were .iij. braunches and it was as though it budded and her blossos shottforth: and ye grapes there of waxed rype.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 11, 'And I had Pharaos cuppe in my hande and toke of the grapes and wronge them in to Pharaos cuppe and delyvered Pharaos cuppe into his hande.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 12, 'And Ioseph sayde vnto him this is the interpretation of it.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 13, 'The .iij. braunches ar thre dayes: for within thre dayes shall Pharao lyft vp thine heade and restore the vnto thyne office agayne and thou shalt delyuer Pharaos cuppe in to his hade after the old maner even as thou dydest when thou wast his butlar.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 14, 'But thinke on me with the when thou art in good case and shewe mercie vnto me. And make mencion of me to Pharao and helpe to brynge me out of this house:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 15, 'for I was stollen out of the lande of the Hebrues and here also haue I done nothige at all wherfore they shulde haue put me in to this dongeon.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 16, 'When the chefe baker sawe that he had well interpretate it he sayde vnto Ioseph me thought also in my dreame yt I had. iij. wyker baskettes on my heade?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 17, 'And in ye vppermost basket of all maner bakemeates for Pharao. And the byrdes ate them out of the basket apon my heade');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 18, 'Ioseph answered and sayde: this is the interpretation therof. The .iij. baskettes are .iij. dayes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 19, 'for this daye .iij. dayes shall Pharao take thy heade from the and shall hange the on a tree and the byrdes shall eate thy flesh from of the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 20, 'And it came to passe the thyrde daye which was Pharaos byrth daye that he made a feast vnto all his servauntes. And he lyfted vpp the head of the chefe buttelar and of the chefe baker amonge his servauntes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 21, 'And restored the chefe buttelar vnto his buttelarshipe agayne and he reched the cuppe in to Pharaos hande');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 22, 'ad hanged the chefe baker: eue as Ioseph had interpretated vnto the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 40, 23, 'Notwithstonding the chefe buttelar remembred not Ioseph but forgat hym.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 1, 'And it fortuned at .ij. yeres end that Pharao dreamed and thought that he stode by a ryuers syde and that there came out of the ryver');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 2, '.vij. goodly kyne and fatt fleshed and fedd in a medowe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 3, 'And him though that .vij. other kyne came vp after them out of the ryver euelfauored and leane fleshed and stode by the other vpon the brynke of the ryuer.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 4, 'And the evill favored and Ienefleshed kyne ate vp the .vij. welfauored and fatt kyne: and be awoke their with.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 5, 'And he slepte agayne and dreamed the second tyme that .vij. eares of corne grewe apon one stalke rancke and goodly.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 6, 'And that .vij. thynne eares blasted with the wynde spronge vp after them:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 7, 'and that the .vij. thynne eares deuowrerd the .vij. rancke and full eares. And than Pharao awaked: and se here is his dreame.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 8, 'When the mornynge came his sprete was troubled And he sent and casted for all the soythsayers of Egypte and all the wyse men there of and told them his dreame: but there was none of them that coude interpretate it vnto Pharao.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 9, 'Than spake the chefe buttelar vnto Pharao saynge. I do remembre my fawte this daye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 10, 'Pharao was angrie with his servauntes and put in warde in the chefe marshals house both me and the chefe baker.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 11, 'And we dreamed both of vs in one nyght and ech mannes dreame of a sondrye interpretation.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 12, 'And there was with vs a yonge man an Hebrue borne servaunte vnto the chefe marshall. And we told him and he declared oure dreames to vs acordynge to ether of oure dreames.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 13, 'And as he declared them vnto vs euen so it came to passe. I was restored to myne office agayne and he was hanged.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 14, 'Than Pharao sent and called Ioseph. And they made him haste out of preson. And he shaued him self and chaunged his rayment and went in to Pharao.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 15, 'And Pharao sayde vnto Ioseph: I haue dreamed a dreame and no man ca interpretate it but I haue herde saye of the yt as soon as thou hearest a dreame thou dost interpretate it.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 16, 'And Ioseph answered Pharao saynge: God shall geue Pharao an answere of peace without me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 17, 'Pharao sayde vnto Ioseph: in my dreame me thought I stode by a ryvers syde and there came out of the ryver');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 18, 'vij fatt fleshed ad well fauored kyne and fedd in the medowe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 19, 'And then .vij. other kyne came vp after them poore and very euell fauored ad leane fleshed: so that I neuer sawe their lyke in all the lande of Egipte in euell fauordnesse.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 20, 'And the .vij. leane and euell fauored kyne ate vpp the first .vij. fatt kyne');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 21, 'And when they had eaten them vp a man cowde not perceaue that they had eate them: for they were still as evyll fauored as they were at the begynnynge. And I awoke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 22, 'And I sawe agayne in my dreame .vij. eares sprynge out of one stalk full and good');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 23, 'and .vij. other eares wytherd thinne and blasted with wynde sprynge vp after them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 24, 'And the thynne eares deuowred the .vij. good cares. And I haue tolde it vnto the sothsayers but no man can tell me what it meaneth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 25, 'Then Ioseph sayde vnto Pharao: both Pharaos dreames are one. And god doth shewe Pharao what he is aboute to do.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 26, 'The vij. good kyne are .vij yeare: and the .vij. good eares are .vij. yere also and is but one dreame.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 27, 'Lykewyse the .vij. thynne and euell fauored kyne that came out after them are .vij. yeares: and the .vij. emptie and blasted eares shalbe vij. yeares of hunger.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 28, 'This is that which I sayde vnto Pharao that God doth shewe Pharao what he is aboute to doo.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 29, 'Beholde there shall come .vij. yere of great plenteousnes through out all the lande of Egypte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 30, 'And there shall aryse after them vij. yeres of hunger. So that all the plenteousnes shalbe forgeten in the lande of Egipte. And the hunger shall consume the lande:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 31, 'so that the plenteousnes shall not be once asene in the land by reason of that hunger that shall come after for it shalbe exceading great');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 32, 'And as concernynge that the dreame was dubled vnto Pharao the second tyme it belokeneth that the thynge is certanly prepared of God ad that God will shortly brynge it to passe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 33, 'Now therfore let Pharao provyde for a man of vnderstondynge and wysdome and sett him over the lande of Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 34, 'And let Pharao make officers ouer the lande and take vp the fyfte parte of the land of Egipte in the vij. plenteous yeres');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 35, 'and let them gather all the foode of these good yeres that come ad lay vp corne vnder the power of Pharo: that there may be foode in the cities');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 36, 'and there let them kepte it: that there may be foode in stoore in the lande agaynst the .vij. yeres of hunger which shall come in the lande of Egipte and that the lande perishe not thorow hunger.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 37, 'And the saynge pleased Pharao ad all his seruauntes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 38, 'Than sayde Pharao vnto his seruavauntes: where shall we fynde soch a ma as this is that hath the sprete of God in him?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 39, 'wherfore Pharao sayde vnto Ioseph: for as moch as God hath shewed the all this there is no man of vnderstondyng nor of wysdome lyke vnto the');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 40, 'Thou therfore shalt be ouer my house and acordinge to thy worde shall all my people obey: only in the kynges seate will I be aboue the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 41, 'And he sayde vnto Ioseph: beholde I haue sett the ouer all the lande of Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 42, 'And he toke off his rynge from his fyngre and put it vpon Iosephs fingre and arayed him in raymet of bisse and put a golden cheyne aboute his necke');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 43, 'and set him vpon the best charett that he had saue one. And they cryed before him Abrech ad that Pharao had made him ruelar ouer all the lande of Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 44, 'And Pharao sayde vnto Ioseph: I am Pharao without thi will shall no man lifte vp ether his hande or fote in all the lande of Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 45, 'And be called Iosephs name Zaphnath Paenea. And he gaue him to wyfe Asnath the doughter of Potiphara preast of On. Than went Ioseph abrode in the lade of Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 46, 'And he was .xxx. yere olde whe he stode before Pharao kynge of Egipte. And than Ioseph departed from Pharao and went thorow out all the lande of Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 47, 'And in the .vij. pleteous yeres they made sheves and gathered');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 48, 'vp all the fode of the .vij. plenteous yeres which were in the lande of Egipte and put it in to the cities. And he put the food of the feldes that grewe rounde aboute euery cyte: euen in the same.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 49, 'And Ioseph layde vp corne in stoore lyke vnto the sande of the see in multitude out of mesure vntyll he left nombrynge: For it was with out nombre.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 50, 'And vnto Ioseph were borne .ij. sonnes before the yeres of hunger came which Asnath the doughter of Potiphara preast of On bare vnto him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 51, 'And he called the name of the first sonne Manasse for God (sayde he) hath made me forgett all my laboure and all my fathers husholde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 52, 'The seconde called he Ephraim for God (sayde he) hath caused me to growe in the lande of my trouble.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 53, 'And when the .vij. yeres plenteousnes that was in the lands of Egypte were ended');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 54, 'than came the .vij. yeres of derth acordynge as Ioseph had sayde. And the derth was in all landes: but in the lade of Egipte was there yet foode.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 55, 'When now all the lande of Egipte began to hunger than cried the people to Pharao for bread. And Pharao sayde vnto all Egipte: goo vnto Ioseph and what he sayth to you that doo');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 56, 'And when the derth was thorow out all the lande Ioseph opened all that was in the cities and solde vnto the Egiptias And hunger waxed fore in the land of Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 41, 57, 'And all countrees came to Egipte to Ioseph for to bye corne: because that the hunger was so sore in all landes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 1, 'When Iacob sawe that there was corne to be solde in Egipte he sayde vnto his sones: why are ye negligent?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 2, 'beholde I haue hearde that there is corne to be solde in Egipte. Gete you thither and bye vs corne fro thece that we maye lyue and not dye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 3, 'So went Iosephs ten brethern doune to bye corne in Egipte');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 4, 'for Ben Iamin Iosephs brother wold not Iacob sende with his other brethren: for he sayde: some mysfortune myght happen him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 5, 'And the sonnes of Israell came to bye corne amonge other that came for there was derth also in the lande of Canaan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 6, 'And Ioseph was gouerner in the londe and solde corne to all the people of the londe. And his brethren came and fell flatt on the grounde before him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 7, 'When Ioseph sawe his brethern he knewe them: But made straunge vnto them and spake rughly vnto them saynge: Whence come ye? and they sayde: out of the lande of Canaan to bye vitayle.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 8, 'Ioseph knewe his brethern but they knewe not him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 9, 'And Ioseph remembred his dreames which he dreamed of them and sayde vnto them: ye are spies and to se where the lande is weake is youre comynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 10, 'And they sayde vnto him: nay my lorde: but to bye vitayle thy seruauntes are come.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 11, 'We are all one mans sonnes and meane truely and thy seruauntes are no spies.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 12, 'And he sayde vnto them: nay verely but euen to se where the land is weake is youre comynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 13, 'And they sayde: we thi seruauntes are .xij. brethern the sonnes of one man in the lande of Canaan. The yongest is yet with oure father and one no man woteth where he is.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 14, 'Ioseph sayde vnto them that is it that I sayde vnto you that ye are surelye spies.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 15, 'Here by ye shall be proued. For by the lyfe of Pharao ye shall not goo hence vntyll youre yongest brother be come hither.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 16, 'Sende therfore one off you and lett him fett youre brother and ye shalbe in preason in the meane season. And thereby shall youre wordes be proued whether there be any trueth in you: or els by the lyfe of Pharao ye are but spies.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 17, 'And he put them in warde thre dayes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 18, 'And Ioseph sayde vnto the the thryd daye: This doo and lyue for I feare Gode');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 19, 'Yf ye meane no hurte let one of youre brethern be bounde in the preason and goo ye and brynge the necessarie foode vnto youre housholdes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 20, 'and brynge youre yongest brother vnto me: that youre wordes maye be beleved ad that ye dye not And they did so.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 21, 'Than they sayde one to a nother: we haue verely synned agaynst oure brother in that we sawe the anguysh of his soull when he besought us and wold not heare him: therfore is this troubyll come apon us.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 22, 'Ruben answered the saynge: sayde I not vnto you that ye shulde not synne agaynst the lad? but ye wolde not heare And now verely see his bloude is requyred.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 23, 'They were not aware that Ioseph vnderstode them for he spake vnto them by an interpreter.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 24, 'And he turned from them and wepte and than turned to them agayne ad comened with them and toke out Simeon from amonge the and bownde him before their eyes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 25, 'ad commaunded to fyll their saekes wyth corne and to put euery mans money in his sacke and to geue them vitayle to spende by the waye. And so it was done to them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 26, 'And they laded their asses with the corne and departed thence.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 27, 'And as one of them opened his sacke for to geue his asse prauender in the Inne he spied his money in his sacks mouth');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 28, 'And he sayde vnto his brethren: my money is restored me agayne and is eue in my sackes mouth Than their hartes fayled them and were astoynyed and sayde one to a nother: how cometh it that God dealeth thus with us?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 29, 'And they came vnto Iacob their father vnto the lande of Canaan and tolde him all that had happened them saynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 30, 'The lorde of the lade spake rughly to us and toke us for spyes to serche the countte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 31, 'And we sayde vnto him: we meane truely and are no spies.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 32, 'We be .xij. bretren sones of oure father one is awaye and the yongest is now with oure father in the lande of Canaan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 33, 'And the lorde of the countre sayde vnto us: here by shall I knowe yf ye meane truely: leaue one of youre brethern here with me and take foode necessary for youre housholdes and get you awaye');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 34, 'and brynge youre yongest brother vnto me And thereby shall I knowe that ye are no spyes but meane truely: So will I delyuer you youre brother agayne and ye shall occupie in the lande.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 35, 'And as they emptied their sackes beholde: euery mans bundell of money was in his sacke And when both they and their father sawe the bundells of money they were afrayde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 36, 'And Iacob their father sayde vnto them: Me haue ye robbed of my childern: Ioseph is away and Simeon is awaye and ye will take Ben Iamin awaye. All these thinges fall vpon me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 37, 'Ruben answered his father saynge: Slee my two sonnes yf I bringe him not to the agayne. Delyuer him therfore to my honde and I will brynge him to the agayne:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 42, 38, 'And he sayde: my sonne shall not go downe with you. For his brother is dead and he is left alone Moreouer some mysfortune myght happen vpon him by the waye which ye goo. And so shuld ye brynge my gray head with sorowe vnto the graue.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 1, 'And the derth waxed sore in the lande.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 2, 'And when they had eate vp that corne which they brought out of the lande of Egipte their father sayde vnto them: goo agayne and by vs a litle food.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 3, 'Than sayde Iuda vnto him: the man dyd testifie vnto vs saynge: loke that ye see not my face excepte youre brother be with you.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 4, 'Therfore yf thou wilt sende oure brother with vs we wyll goo and bye the food.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 5, 'But yf thou wylt not sende him we wyll not goo: for the man sayde vnto vs: loke that ye see not my face excepte youre brother be with you.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 6, 'And Israell sayde: wherfore delt ye so cruelly with me as to tell the man that ye had yet another brother?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 7, 'And they sayde: The man asked vs of oure kynred saynge: is youre father yet alyue? haue ye not another brother? And we tolde him acordynge to these wordes. How cowd we knowe that he wolde byd vs brynge oure brother downe with vs?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 8, 'Than sayde Iuda vnto Israell his father: Send the lad with me and we wyll ryse and goo that we maye lyue and not dye: both we thou and also oure childern.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 9, 'I wilbe suertie for him and of my handes requyre him. Yf I brynge him not to the and sett him before thine eyes than let me bere the blame for euer.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 10, 'For except we had made this tarieg: by this we had bene there twyse and come agayne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 11, 'Than their father Israel sayde vnto the Yf it must nedes be so now: than do thus take of the best frutes of the lande in youre vesselles and brynge the man a present a curtesie bawlme and a curtesie of hony spyces and myrre dates and almondes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 12, 'And take as moch money more with you. And the money that was brought agayne in youre sackes take it agayne with you in youre handes peraduenture it was some ouersyghte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 13, 'Take also youre brother with you and aryse and goo agayne to the man.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 14, 'And God almightie geue you mercie in the sighte of the man and send you youre other brother and also Be Iamin and I wilbe as a ma robbed of his childern.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 15, 'Thus toke they the present and twise so moch more money with them and Ben Iamin. And rose vp went downe to Egipte and presented them selfe to Ioseph.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 16, 'When Ioseph sawe Ben Iamin with them he sayde to the ruelar of his house: brynge these men home and sley and make redie: for they shall dyne with me at none.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 17, 'And the man dyd as Ioseph bad and brought them in to Iosephs house.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 18, 'When they were brought to Iosephs house they were afrayde ad sayde: be cause of the money yt came in oure sackes mouthes at the first tyme are we brought to pyke a quarell with vs and to laye some thinge to oure charge: to brynge us in bondage and oure asses also.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 19, 'Therfore came they to the man that was the ruelar ouer Iosephs house and comened with him at the doore');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 20, 'and sayde:Sir we came hither at the first tyme to bye foode');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 21, 'and as we came to an Inne and opened oure sackes: beholde euery mannes money was in his sacke with full weghte: But we haue broght it agene with us');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 22, 'and other mony haue we brought also in oure handes to bye foode but we can not tell who put oure money in oure sackes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 23, 'And he sayde: be of good chere feare not: Youre God and the God of youre fathers hath put you that treasure in youre sackes for I had youre money. And he brought Simeon out to them');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 24, 'ad led the into Iosephs house and gaue the water to washe their fete and gaue their asses prauender:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 25, 'And they made redie their present agaynst Ioseph came at none for they herde saye that they shulde dyne there.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 26, 'When Ioseph came home they brought the present in to the house to him which they had in their handes ad fell flat on the grounde befor him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 27, 'And he welcomed the curteously sainge: is youre father that old man which ye tolde me of in good health? and is he yet alyue?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 28, 'they answered: thy servaunte oure father is in good health ad is yet alyue. And they bowed them selues and fell to the grounde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 29, 'And he lyfte vp his eyes and behelde his brother Ben Iamin his mothers sonne and sayde: is this youre yongest brother of whome ye sayde vnto me? And sayde: God be mercyfull vnto ye my sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 30, 'And Ioseph made hast (for his hert dyd melt apon his brother) and soughte for to wepe and entred in to his chambre for to wepe there.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 31, 'And he wasshed his face and came out and refrayned himselfe and bad sett bread on the table');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 32, 'And they prepared for him by himselfe and for them by them selues and for the Egiptians which ate with him by them selues because the Egyptians may not eate bread with the Hebrues for that is an abhomynacyon vnto the Egiptians.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 33, 'And they satt before him: the eldest acordynge vnto his age and the yongest acordyng vnto his youth. And the men marveled amonge them selves.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 43, 34, 'And they broughte rewardes vnto them from before him: but Ben Iamins parte was fyue tymes so moch as any of theirs. And they ate and they dronke and were dronke wyth him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 1, 'And he commaunded the rueler of his house saynge: fyll the mens sackes with food as moch as they can carie');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 2, 'and put euery mans money in his bagge mouth and put my syluer cuppe in the sackes mouth of the yongest and his corne money also. And he dyd as Ioseph had sayde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 3, 'And in ye mornynge as soone as it was lighte the me were let goo with their asses.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 4, 'And when they were out of the cytie and not yet ferre awaye Ioseph sayde vnto the ruelar of his house: vp and folowe after the men and ouertake them and saye vnto them: wherefore haue ye rewarded euell for good?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 5, 'is that not the cuppe of which my lorde drynketh ad doth he not prophesie therin? ye haue euell done that ye haue done.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 6, 'And he ouertoke them and sayde the same wordes vnto them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 7, 'And they answered him: wherfore sayth my lorde soch wordes? God forbydd that thy servauntes shulde doo so.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 8, 'Beholde the money which we founde in oure sackes mouthes we brought agayne vnto the out of the lande of Canaa: how then shulde we steale out of my lordes house ether syluer or golde?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 9, 'with whosoeuer of thy seruauntes it be founde let him dye and let vs also be my lordes bondmen.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 10, 'And he sayde: Now therfore acordynge vnto youre woordes he with whom it is found shalbe my seruaunte: but ye shalbe harmelesse.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 11, 'And attonce euery man toke downe his sacke to the grounde ad every man opened his sacke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 12, 'And he serched and began at the eldest and left at the yongest. And the cuppe was founde in Ben Iamins sacke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 13, 'Then they rent their clothes and laded euery man his asse and went agayne vnto the cytie.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 14, 'And Iuda and his brethre came to Iosephs house for he was yet there ad they fell before him on the grounde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 15, 'And Ioseph sayde vnto the: what dede is this which ye haue done? wist ye not that soch a man as I can prophesie?.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 16, 'Then sayde Iuda: what shall we saye vnto my lorde what shall we speake or what excuse can we make? God hath founde out ye wekednesse of thy seruauntes. Beholde both we and he with whom the cuppe is founde are thy seruauntes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 17, 'And he answered: God forbyd ye I shulde do so the man with whom the cuppe is founde he shalbe my seruaunte: but goo ye in peace vn to youre father.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 18, 'Then Iuda went vnto him and sayde: oh my lorde let thy servaunte speake a worde in my lordes audyence and be not wrooth with thi servaunte: for thou art euen as Pharao.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 19, 'My lorde axed his seruaunte sainge: haue ye a father or a brother?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 20, 'And we answered my lord we haue a father that is old and a yonge lad which he begat in his age: ad the brother of the sayde lad is dead and he is all that is left of that mother. And his father loueth him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 21, 'Then sayde my lorde vnto his seruauntes brynge him vnto me that I maye sett myne eyes apon him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 22, 'And we answered my lorde that the lad coude not goo from his father for if he shulde leaue his father he were but a deed man.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 23, 'Than saydest thou vnto thy servauntes: excepte youre yongest brother come with you loke that ye se my face no moare.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 24, 'And when we came vnto thy servaunt oure father we shewed him what my lorde had sayde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 25, 'And when oure father sayde vnto vs goo agayne and bye vs a litle fode:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 26, 'we sayd yt we coude not goo. Neverthelesse if oure youngeste brother go with vs then will we goo for we maye not see the mannes face excepte oure yongest brother be with vs.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 27, 'Then sayde thy servaunt oure father vnto vs. Ye knowe that my wyfe bare me .ij. sonnes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 28, 'And the one went out from me and it is sayde of a suertie that he is torne in peaces of wyld beastes and I sawe him not sence.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 29, 'Yf ye shall take this also awaye fro me and some mysfortune happen apon him then shall ye brynge my gray heed with sorow vnto the grave.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 30, 'Now therfore whe I come to thy servaunt my father yf the lad be not with me: seinge that his lyfe hageth by the laddes lyfe');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 31, 'then as soone as he seeth that the lad is not come he will dye. So shall we thy servautes brynge the gray hedde of thy servaunt oure father with sorow vnto the grave.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 32, 'For I thy servaunt became suertie for the lad vnto my father and sayde: yf I bringe him not vnto the agayne. I will bere the blame all my life loge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 33, 'Now therfore let me thy servaunt byde here for ye lad and be my lordes bondman: and let the lad goo home with his brethern.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 44, 34, 'For how can I goo vnto my father and the lad not wyth me: lest I shulde see the wretchednes that shall come on my father.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 1, 'And Ioseph coude no longer refrayne before all them that stode aboute him but commaunded that they shuld goo all out from him and that there shuld be no man with him whyle he vttred him selfe vnto his brethern.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 2, 'And he wepte alowde so that the Egiptians and the house of Pharao herde it.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 3, 'And he sayde vnto his brethern: I am Ioseph: doth my father yet lyue? But his brethern coude not answere him for they were abasshed at his presence.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 4, 'And Ioseph sayde vnto his brethern: come nere to me and they came nere. And he sayde: I am Ioseph youre brother whom ye sold in to Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 5, 'And now be not greued therwith nether let it seme a cruel thinge in youre eyes that ye solde me hither. For God dyd send me before you to saue lyfe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 6, 'For this is the seconde yere of derth in the lande and fyue moo are behynde in which there shall nether be earynge nor hervest.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 7, 'Wherfore God sent me before you to make prouision that ye myghte continue in the erth and to save youre lyues by a greate delyuerance.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 8, 'So now it was not ye that sent me hither but God: and he hath made me father vnto Pharao and lorde ouer all his house and rueler in all the land of Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 9, 'Hast you ad goo to my father and tell him this sayeth thy sonne Ioseph: God hath made me lorde ouer all Egipte. Come downe vnto me and tarye not');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 10, 'And thou shalt dwell in the londe of Gosan and be by me: both thou and thi childern and thi childerns childern: and thy shepe and beestes and all that thou hast.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 11, 'There will I make provision for the: for there remayne yet v yeres of derth lest thou and thi houshold and all that thou hast perish.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 12, 'Beholde youre eyes do se and the eyes also of my brother Ben Iamin that I speake to you by mouth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 13, 'Therfore tell my father of all my honoure which I haue in Egipte and of all that ye haue sene ad make hast and brynge in father hither.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 14, 'And he fell on his brother Ben Iamis necke and wepte and Ben Iamin wepte on his necke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 15, 'Moreouer he fylled all his brethern and wepte apon them. And after that his brethern talked with him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 16, 'And when the tidynges was come vnto Pharaos housse that Iosephes brethern were come it pleased Pharao well and all his seruauntes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 17, 'And Pharao spake vnto Ioseph: saye vnto thy brethern this do ye: lade youre beestes ad get you hence And when ye be come vnto the londe of Canaan');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 18, 'take youre father and youre housholdes and come vnto me and I will geue you the beste of the lande of Egipte and ye shall eate the fatt of the londe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 19, 'And commaunded also. This do ye: take charettes with you out of the lande of Egipte for youre childern and for youre wyues: and brynge youre father and come.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 20, 'Also regarde not youre stuff for the goodes of all the londe of Egipte shalbe youres.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 21, 'And the childern of Israell dyd euen so And Ioseph gaue them charettes at the commaundment of Pharao and gaue them vitayle also to spende by the waye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 22, 'And he gaue vnto eche of them chaunge of rayment: but vnto Ben Iamin he gaue .iij. hundred peces of syluer and .v. chaunge of rayment.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 23, 'And vnto his father he sent after the same maner: .x. he asses laden with good out of Egipte and .x. she asses laden with corne bred and meate: to serue his father by the waye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 24, 'So sent he his brethern awaye and they departed. And he sayde vnto them: se that ye fall nor out by the waye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 25, 'And they departed from Egipte and came in to the land of Canaan vnto Iacob their father and told him saynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 26, 'Ioseph is yet a lyue and is gouerner ouer all the land of Egipte. And Iacobs hert wauered for he beleued tho not.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 27, 'And they tolde him all the wordes of Ioseph which he had sayde vnto them. But when he sawe the charettes which Ioseph had sent to carie him then his sprites reviued.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 45, 28, 'And Israel sayde. I haue ynough yf Ioseph my sonne be yet alyue: I will goo and se him yer that I dye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 1, 'Israel toke his iourney with all that he had and came vnto Berseba and offred offrynges vnto the God of his father Isaac.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 2, 'And God sayde vnto Israel in a vision by nyghte and called vnto him: Iacob Iacob. And he answered: here am I.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 3, 'And he sayde: I am that mightie God of thy father feare not to goo downe in to Egipte. For I will make of the there a great people.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 4, 'I will go downe with ye in to Egipte and I will also bringe the vp agayne and Ioseph shall put his hand apon thine eyes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 5, 'And Iacob rose vp from Berseba. And ye sonnes of Israel I caried Iacob their father ad their childern and their wyues in the charettes which Pharao had sent to carie him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 6, 'And they toke their catell ad the goodes which they had gotten in the land of Canaan and came in to Egipte: both Iacob and all his seed with him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 7, 'his sonnes and his sonnes sonnes with him: his doughters and his sonnes doughters and all his seed brought he with him in to Egipte.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 8, 'These are the names of the childern of Israel which came in to Egipte both Iacob and his sonnes: Rube Iacobs first sonne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 9, 'The childern of Ruben: Hanoch Pallu Hezron and Charmi.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 10, 'The childern of Simeon: Iemuel Iamin Ohad Iachin Zohar and Saul the sonne of a Cananitish woman');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 11, 'The childern of Leui: Gerson Rahath and Merari.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 12, 'The childern of Iuda: Er Onan Sela Pharez and Zerah but Er and Onan dyed in the lande of Canaan. The childern of Pharez Hezro and Hamul.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 13, 'The childern of Isachar: Tola Phuva Iob and Semnon.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 14, 'The childern of Sebulon: Sered Elon and Iaheleel.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 15, 'These be the childern of Lea which she bare vnto Iacob in Mesopotamia with his doughter Dina. All these soulles of his sonnes and doughters make .xxx and .vi.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 16, 'The childern of Gad: Ziphion Haggi Suni Ezbon Eri Arodi and Areli.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 17, 'The childern of Asser: Iemna Iesua Iesui Brya and Serah their sister. And the childern of Brya were Heber and Malchiel.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 18, 'These are the childern of Silpha whom Laba gaue to Lea his doughter. And these she bare vnto Iacob in nombre xvi. soules.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 19, 'The childern of Rahel Iacobs wife: Ioseph and ben Iamin.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 20, 'And vnto Ioseph in the lode of Egipte were borne: Manasses and Ephraim which Asnath the doughter of Potiphera preast of On bare vnto him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 21, 'The childern of BenIamin: Bela Becher Asbel Gera Naeman Ehi Ros Mupim Hupim and Aro.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 22, 'These are the childern of Rahel which were borne vnto Iacob: xiiij. soules all to gether.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 23, 'The childern of Dan: Husim.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 24, 'The childern of Nepthali? Iahezeel Guni Iezer and Sillem.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 25, 'These are the sonnes of Bilha which Laban gaue vnto Rahel his doughter and she bare these vnto Iacob all together .vij. soulles');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 26, 'All the soulles that came with Iacob into Egipte which came out of his loyns (besyde his sonnes wifes) were all togither .lx. and .vi. soulles.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 27, 'And the sonnes of Ioseph which were borne him in egipte were .ij. soules: So that all the soulles of the house of Iacob which came in to Egipte are lxx.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 28, 'And he sent Iuda before him vnto Ioseph that the waye myghte be shewed him vnto Gosan and they came in to the lande of Gosan');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 29, 'And Ioseph made redie his charett and went agaynst Israell his father vnto Gosan ad presented him selfe vnto him and fell on his necke and wepte vpon his necke a goode whyle.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 30, 'And Israel sayd vnto Ioseph: Now I am cotet to dye in somoch I haue sene the that thou art yet alyue.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 31, 'And Ioseph sayde vnto his brethre and vnto his fathers house: I will goo and shewe Pharao and tell him: that my brethern and my fathers housse which were in the lade of Canaan are come vnto me');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 32, 'and how they are shepardes (for they were men of catell) and they haue brought their shepe and their oxen and all that they haue with them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 33, 'Yf Pharao call you and axe you what youre occupation');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 46, 34, 'is saye: thi seruauntes haue bene occupyed aboute catell fro oure chilhode vnto this tyme: both we and oure fathers that ye maye dwell in the lande of Gosan. For an abhominacyon vnto the Egiptians are all that feade shepe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 1, 'And Ioseph wet and tolde Pharao and sayde: my father and my brethern their shepe and their beastes and all that they haue are come out of the lade of Canaan and are in the lande of Gosan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 2, 'And Ioseph toke a parte of his brethern: euen fyue of them and presented them vnto Pharao.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 3, 'And Pharao sayde vnto his brethern: what is youre occupation? And they sayde vnto Pharao: feaders of shepe are thi seruauntes both we ad also oure fathers.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 4, 'They sayde moreouer vnto Pharao: for to sogcorne in the lande are we come for thy seruauntes haue no pasture for their shepe so sore is the fameshment in the lande of Canaan. Now therfore let thy seruauntes dwell in the lande of Gosan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 5, 'And Pharao sayde vnto Ioseph: thy father and thy brethren are come vnto the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 6, 'The londe of Egipte is open before the: In the best place of the lande make both thy father and thy brothren dwell: And even in the lond of Gosan let them dwell. Moreouer yf thou knowe any men of actiuyte amonge them make them ruelars ouer my catell.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 7, 'And Ioseph brought in Iacob his father and sett him before Pharao And Iacob blessed Pharao.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 8, 'And Pharao axed Iacob how old art thou?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 9, 'And Iacob sayde vnto Pharao: the dayes of my pilgremage are an hundred and .xxx. yeres. Few and euell haue the dayes of my lyfe bene and haue not attayned vnto the yeres of the lyfe of my fathers in the dayes of their pilgremages.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 10, 'And Iacob blessed Pharao and went out from him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 11, 'And Ioseph prepared dwellinges for his father and his brethern and gaue them possessions in the londe of Egipte in the best of the londe: eue in the lande of Raemses as Pharao commaunded.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 12, 'And Ioseph made prouysion for his father his brethern and all his fathers housholde as yonge childern are fedd with bread.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 13, 'There was no bread in all the londe for the derth was exceadige sore: so yt ye lode of Egipte and ye lode of Canaan were fameshyd by ye reason of ye derth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 14, 'And Ioseph brought together all ye money yt was founde in yt lade of Egipte and of Canaan for ye corne which they boughte: and he layde vp the money in Pharaos housse.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 15, 'When money fayled in the lade of Egipte and of Canaan all the Egiptians came vnto Ioseph and sayde: geue us sustenaunce: wherfore suffrest thou vs to dye before the for oure money is spent.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 16, 'Then sayde Ioseph: brynge youre catell and I well geue yow for youre catell yf ye be without money.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 17, 'And they brought their catell vnto Ioseph. And he gaue them bread for horses and shepe and oxen and asses: so he fed them with bread for all their catell that yere.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 18, 'When that yere was ended they came vnto him the nexte yere and sayde vnto him: we will not hydest from my lorde how that we haue nether money nor catell for my lorde: there is no moare left for my lorde but euen oure bodies and oure londes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 19, 'Wherfore latest thou us dye before thyne eyes and the londe to goo to noughte? bye us and oure landes for bread: and let both vs and oure londes be bonde to Pharao. Geue vs seed that we may lyue and not dye and that the londe goo not to wast.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 20, 'And Ioseph boughte all the lande of Egipte for Pharao. For the Egiptians solde euery man his londe because the derth was sore apo them: and so the londe be came Pharaos.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 21, 'And he appoynted the people vnto the cities from one syde of Egipte vnto the other:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 22, 'only the londe of the Prestes bought he not. For there was an ordinauce made by Pharao for ye preastes that they shulde eate that which was appoynted vnto them: which Pharao had geuen them wherfore they solde not their londes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 23, 'Then Ioseph sayde vnto the folke: beholde I haue boughte you this daye ad youre landes for Pharao. Take there seed and goo sowe the londe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 24, 'And of the encrease ye shall geue the fyfte parte vnto Pharao and .iiij. partes shalbe youre awne for seed to sowe the feld: and for you and them of youre housholdes and for youre childern to eate.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 25, 'And they answered: Thou haste saued oure lyves Let vs fynde grace in the syghte of my lorde and let us be Pharaos servautes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 26, 'And Ioseph made it a lawe ouer the lade of Egipte vnto this daye: that men must geue Pharao the fyfte parte excepte the londe of the preastes only which was not bond vnto Pharao.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 27, 'And Israel dwelt in Egipte: euen in the countre of Gosan. And they had their possessions therein and they grewe and multiplyed exceadingly.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 28, 'Moreouer Iacob lyued in the lande of Egipte .xvij. yeres so that the hole age of Iacob was an hundred and .xlvij. yere.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 29, 'When the tyme drewe nye that Israel must dye: he sent for his sonne Ioseph and sayde vnto him: Yf I haue founde grace in thy syghte put thy hande vnder my thye and deale mercifully ad truely with me that thou burie me not in Egipte:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 30, 'but let me lye by my fathers and carie me out of Egipte and burie me in their buryall. And he answered: I will do as thou hast sayde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 47, 31, 'And he sayde: swere vnto me: ad he sware vnto him. And than Israel bowed him vnto the beddes head.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 1, 'After these deades tydiges were brought vnto Ioseph: that his father was seke. And he toke with him his ij. sones Manasses and Ephraim.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 2, 'Then was it sayde vnto Iacob: beholde thy sonne Ioseph commeth vnto the. And Israel toke his strength vnto him and satt vp on the bedd');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 3, 'and sayde vnto Ioseph: God all mightie appeared vnto me at lus in the lande of Canaan ad blessed me');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 4, 'and sayde vnto me: beholde I will make the growe and will multiplye the and will make a great nombre of people of the and will geue this lande vnto the and vnto thy seed after ye vnto an euerlastinge possession.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 5, 'Now therfore thy .ij. sones Manasses ad Ephraim which were borne vnto the before I came to the in to Egipte shalbe myne: euen as Ruben and Simeo shall they be vnto me.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 6, 'And the childern which thou getest after them shalbe thyne awne: but shalbe called with the names of their brethern in their enheritaunces.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 7, 'And after I came from Mesopotamia Rahel dyed apon my hande in the lande of Canaa by the waye: when I had but a feldes brede to goo vnto Ephrat. And I buried her there in ye waye to Ephrat which is now called Bethlehem.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 8, 'And Israel behelde Iosephes sonnes and sayde: what are these?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 9, 'And Ioseph sayde vnto his father: they are my sonnes which God hath geuen me here. And he sayde: brynge them to me and let me blesse them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 10, 'And the eyes of Israell were dymme for age so that he coude not see. And he broughte them to him ad he kyssed the and embraced them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 11, 'And Israel sayde vnto Ioseph: I had not thoughte to haue sene thy face and yet loo God hath shewed it me and also thy seed.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 12, 'And Ioseph toke them awaye from his lappe and they fell on the grounde before him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 13, 'Than toke Ioseph them both: Ephraim in his ryghte hande towarde Israels left hande ad Manasses in his left hande towarde Israels ryghte hande and brought them vnto him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 14, 'And Israel stretched out his righte hande and layde it apon Ephraims head which was the yonger and his lyft hade apon Manasses heed crossinge his handes for manasses was the elder.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 15, 'And he blessed Ioseph saynge: God before whome my fathers Abraham and Isaac dyd walke and the God which hath fedd me all my life longe vnto this daye');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 16, 'And the angell which hath delyuered me fro all euyll blesse these laddes: yt they maye be called after my name and after my father Abraham and Isaac and that they maye growe ad multiplie apo the erth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 17, 'When Ioseph sawe that his father layd his ryghte hande apon the heade of Ephraim it displeased him. And he lifte vpp his fathers hade to haue removed it from Ephraims head vnto Manasses head');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 18, 'and sayde vnto his father: Not so my father for this is the eldest. Put thy right hande apon his head.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 19, 'And his father wold not but sayde: I knowe it well my sonne I knowe it well. He shalbe also a people ad shalbe great. But of a troth his yonger brother shalbe greatter than he and his seed shall be full of people.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 20, 'And he blessed them sainge. At the ensample of these the Israelites shall blesse and saye: God make the as Ephraim and as Manasses. Thus sett he Ephraim before Manasses.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 21, 'And Israel sayde vnto Ioseph: beholde I dye. And god shalbe with you and bringe you agayne vnto the land of youre fathers.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 48, 22, 'Moreouer I geue vnto the a porcyon of lande aboue thy brethern which I gatt out of the handes of the Amorites with my swerde and wyth my bowe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 1, 'And Iacob called for his sonnes ad sayde: come together that I maye tell you what shall happe you in the last dayes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 2, 'Gather you together and heare ye sonnes of Iacob and herken vnto Israel youre father.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 3, 'Ruben thou art myne eldest sonne my myghte and the begynnynge of my strength chefe in receauynge and chefe in power.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 4, 'As vnstable as water wast thou: thou shalt therfore not be the chefest for thou wenst vp vpo thy fathers bedd and than defyledest thou my couche with goynge vppe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 5, 'The brethern Simeon and Leui weked instrumentes are their wepos.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 6, 'In to their secrettes come not my soule and vnto their congregation be my honoure not coupled: for in their wrath they slewe a man and in their selfewill they houghed an oxe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 7, 'Cursed be their wrath for it was stronge and their fearsnes for it was cruell. I will therfore deuyde them in Iacob and scater them in Israel.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 8, 'Iuda thy brethern shall prayse the and thine hande shalbe in the necke of thyne enimies and thy fathers childern shall stoupe vnto the.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 9, 'Iuda is a lions whelpe. Fro spoyle my sonne thou art come an hye: he layde him downe and couched himselfe as a lion and as a lionesse. Who dare stere him vp?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 10, 'The sceptre shall not departe from Iuda nor a ruelar from betwene his legges vntill Silo come vnto whome the people shall herken.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 11, 'He shall bynde his fole vnto the vine and his asses colt vnto the vyne braunche ad shall wash his garment in wyne and his mantell in the bloud of grapes');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 12, 'his eyes are roudier than wyne ad his teeth whitter then mylke.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 13, 'Zabulon shall dwell in the hauen of the see and in the porte of shippes and shall reache vnto Sidon.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 14, 'Isachar is a stronge asse he couched him doune betwene .ij. borders');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 15, 'and sawe that rest was good and the lande that it was pleasant and bowed his shulder to beare and became a servaunte vnto trybute.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 16, 'Dan shall iudge his people as one of the trybes of Israel.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 17, 'Dan shalbe a serpent in the waye and an edder in the path and byte the horse heles so yt his ryder shall fall backwarde,');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 18, 'After thy sauynge loke I LORde.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 19, 'Gad men of warre shall invade him. And he shall turne them to flyght.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 20, 'Off Asser cometh fatt breed and he shall geue pleasures for a kynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 21, 'Nepthali is a swyft hynde ad geueth goodly wordes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 22, 'That florishynge childe Ioseph that florishing childe and goodly vn to the eye: the doughters come forth to bere ruele.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 23, 'The shoters haue envyed him and chyde with him ad hated him');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 24, 'and yet his bowe bode fast and his armes and his handes were stronge by the handes of the myghtye God of Iacob: out of him shall come an herde ma a stone in Israel.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 25, 'Thi fathers God shall helpe the and the almightie shall blesse the with blessinges from heaven aboue and with blessinges of the water that lieth vnder and with blessinges of the brestes and of the wombe.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 26, 'The blessinges of thy father were stronge: euen as the blessinges of my elders after the desyre of the hiest in the worlde and these blessinges shall fall on the head of Ioseph and on the toppe of the head of him yt was separat from his brethern.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 27, 'Ben Iamin is a raueshynge wolfe. In the mornynge be shall deuoure his praye ad at nyghte he shall deuyde his spoyle.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 28, 'All these are the .xij. tribes of Israel and this is that which their father spake vnto them whe he blessed them euery man with a severall blessinge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 29, 'And he charged them and sayde vnto them. I shall be put vnto my people: se that ye burye me with my fathers in the caue that is in the felde of Ephron the Hethyte');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 30, 'in the double caue that is in the felde before Mamre in the lande of Canaan. Which felde Abraham boughte of Ephron the Hethite for a possessio to burye in.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 31, 'There they buryed Abraha and Sara his wyfe there they buryed Isaac and Rebecca his wyfe. And there I buried Lea:');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 32, 'which felde and the caue that is therin was bought of the childern of Heth.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 49, 33, 'When Iacob had commaunded all that he wold vnto his sonnes be plucked vp his fete apon the bedd and dyed and was put vnto his people.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 1, 'And Ioseph fell apon his fathers face and wepte apon him and kyssed him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 2, 'And Ioseph commaunded his seruauntes that were Phisicions to embawme his father and the Phisicios ebawmed Israel');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 3, '.xl. dayes loge for so loge doth ye embawminge last and the Egiptians bewepte him .lxx. dayes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 4, 'And when the dayes of wepynge were ended Ioseph spake vnto ye house of Pharao saynge: Yf I haue founde fauoure in youre eyes speake vnto Pharao and tell him how that');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 5, 'my father made me swere and sayde: loo Ioye se that thou burye me in my graue which I haue made me in the lande of Canaan. Now therfore let me goo and burye my father ad tha will I come agayne.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 6, 'And Pharao sayde goo and burye thy father acordynge as he made the swere.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 7, 'And Ioseph went vp to burie his father and with him went all the seruauntes of Pharao that were the elders of his house ad all ye elders of Egipte');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 8, 'and all the house of Ioseph ad his brethern and his fathers house: only their childern and their shepe and their catell lefte they behinde them in the lande of Gosan.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 9, 'And there went with him also Charettes and horsemen: so that they were an exceadynge great companye.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 10, 'And when they came to ye feld of Atad beyonde Iordane there they made great and exceadinge sore lamentacio. And he morned for his father .vij. dayes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 11, 'When the enhabiters of the lande the Cananytes sawe the moornynge in ye felde of Atad they saide: this is a greate moornynge which the Egiptians make. Wherfore ye name of the place is called Abel mizraim which place lyeth beyonde Iordane.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 12, 'And his sonnes dyd vnto him acordynge as he had commaunded them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 13, 'And his sonnes caried him in to the land of Canaan and buryed him in the double caue which Abraha had boughte with the felde to be a place to burye in of Ephron the Hethite before Mamre.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 14, 'And Ioseph returned to Egipte agayne and his brethern and all that went vp with him to burye his father assone as he had buryed him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 15, 'Whe Iosephs brethern sawe that their father was deade they sayde: Ioseph myghte fortune to hate us and rewarde us agayne all the euell which we dyd vnto him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 16, 'They dyd therfore a commaundment vnto Ioseph saynge: thy father charged before his deth saynge.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 17, 'This wise say vnto Ioseph forgeue I praye the the trespace of thy brethern and their synne for they rewarded the euell. Now therfore we praye the forgeue the trespace of the servuantes of thy fathers God. And Ioseph wepte when they spake vnto him.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 18, 'And his brethern came ad fell before him and sayde: beholde we be thy servauntes.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 19, 'And Ioseph sayde vnto them: feare not for am not I vnder god?');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 20, 'Ye thoughte euell vnto me: but God turned it vnto good to bringe to passe as it is this daye euen to saue moch people a lyue');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 21, 'feare not therfore for I will care for you and for youre childern and he spake kyndly vnto them.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 22, 'Ioseph dwelt in Egipte and his fathers house also ad lyved an hundred and .x. yere.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 23, 'And Ioseph sawe Ephraims childern eue vnto the thyrde generation. And vnto Machir the sonne of Manasses were childern borne and satt on Iosephs knees.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 24, 'And Ioseph sayde vnto his brethern: I die And God will suerlie vysett you and bringe you out of this lande vnto the lande which he sware vnto Abraham Isaac and Iacob.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 25, 'And Ioseph toke an ooth of the childern of Israel ad sayde: God will not fayle but vysett you se therfore that ye carye my boones hence.');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (1, 50, 26, 'And so Ioseph dyed when he was an hundred and .x. yere olde. And they enbawmed him and put him in a chest in Egipte.');
