INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (59, 1, 16, '');
INSERT INTO `Tyndale_verses` (`book_id`, `chapter`, `verse`, `text`) VALUES (59, 1, 17, '');
